ngspunten toe.</p><p><strong>Algemene Kaders</strong></p><p>Focus op CO2 emissie binnen Nederland: alleen elektriciteit gegenereerd en direct gasverbruik binnen Nederland wordtmmeegenomen.</p><p>Focus op CO₂ emissie die gekoppeld is aan energetisch gebruik: gas als grondstof wordt voorlopig niet meegenomen.</p><p>Voorkomen van dubbel tellen CO₂ emissie. CO₂ alsmgevolg van gasgestookte elektriciteit wordt daarom alleen bij elektriciteit opgeteld. Dit wordt niet toegerekend aan gasverbruik.</p><p><strong>Hoe komen we tot de data?</strong></p><p>Ons uitgangspunt is “meetdata gebruiken we waar het kan, modeleren waar het moet”.</p><p>Basis is ENTSO-E en ENTSO-G data, aangevuld metmmodellen bestaande uit capaciteitsgegevens van CBS, research naarmverwachte capaciteitsgroei, weersafhankelijke modellen en historische datamnanalyse van ENTSO-E en ENTSO-G data</p><p>De energie hoeveelheden worden vermenigvuldigd met emissiefactoren m.b.t. van de stroom etikettering laatst vastgesteldmin 2014. (CE-Delf Stroometikettering 2013, mei 2014).</p><p>Lees ook: <a href=\\\"/nl/faq\\\">Veelgestelde vragen</a></p>\", \"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-05-27 10:22:05','2025-06-11 13:32:00','f9cb1860-0858-4931-946d-ffe81515ebca'),(417,196,4,'Co2 monitor - Uitgangspunten','co2-monitor-uitgangspunten','en/principles','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-05-27 10:22:05','2025-05-27 10:23:28','894be45e-fa63-4898-88a1-c3f424a39b7d'),(418,197,3,'Co2 monitor - Uitgangspunten','co2-monitor-uitgangspunten','uitgangspunten','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-05-27 10:22:05','2025-05-27 10:23:28','2862fca9-c26b-4e1a-b5f9-9a11c806765d'),(419,197,4,'Co2 monitor - Uitgangspunten','co2-monitor-uitgangspunten','en/principles','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-54268611