r het moet”.</p><p>Basis is ENTSO-E en ENTSO-G data, aangevuld metmmodellen bestaande uit capaciteitsgegevens van CBS, research naarmverwachte capaciteitsgroei, weersafhankelijke modellen en historische datamnanalyse van ENTSO-E en ENTSO-G data</p><p>De energie hoeveelheden worden vermenigvuldigd met emissiefactoren m.b.t. van de stroom etikettering laatst vastgesteldmin 2014. (CE-Delf Stroometikettering 2013, mei 2014).</p><p>Lees ook: <a href=\\\"/nl/faq\\\">Veelgestelde vragen</a></p>\"}',1,'2025-06-11 13:32:01','2025-06-11 13:32:01','9b533695-9634-4fb3-8b3d-653904f78221'),(805,399,4,'Co2 monitor - Uitgangspunten','co2-monitor-uitgangspunten','en/principles',NULL,1,'2025-06-11 13:32:01','2025-06-11 13:32:01','07455782-e305-4e5a-9c7b-5509e59d214b'),(806,400,1,'Zonne-energie','zonne-energie','nl/dataportaal/energie-productie/elektriciteit/zonne-energie','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"a48d4561-c3cb-4bdc-9036-6293c6294f67\": \"Pagina titel Zonne energie\", \"b75eb4e3-a1fe-4a21-a36b-ea684f98b438\": \"Page description\", \"ca8ea97c-d3f6-41b2-a020-542686118a81\": [449, 450]}',1,'2025-06-12 06:46:30','2025-06-12 11:46:10','2e7fbf33-4b02-48b1-8914-026f72510227'),(807,400,2,'Zonne-energie','zonne-energie','en/dataportaal/energie-productie/elektriciteit/zonne-energie','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": [449, 450]}',1,'2025-06-12 06:46:30','2025-06-12 11:46:10','e15b3c17-e566-4b20-af3d-8205cef5e0de'),(808,401,1,'Zonne-energie','zonne-energie','nl/dataportaal/energie-productie/elektriciteit/zonne-energie',NULL,1,'2025-06-12 06:46:30','2025-06-12 06:46:30','383884b9-5dbd-4a48-91f9-945c7fe511a0'),(809,401,2,'Zonne-energie','zonne-energie','en/dataportaal/energie-productie/elektriciteit/zonne-energie',NULL,1,'2025-06-12 06:46:30','2025-06-12 06:46:30','a8b7815f-533e-4935-94cd-8338ceafe9b7'),(810,402,1,'Zonne-energie','zonne-energie','nl/dataportaal/energie-productie/elektriciteit/zonne-energie',NULL,1,'202