,'5e7cb774-8113-4f03-8b50-4f9905a65956'),(821,407,2,'Zonne-energie','zonne-energie','en/dataportaal/energie-productie/elektriciteit/zonne-energie',NULL,1,'2025-06-12 07:26:33','2025-06-12 07:26:33','b502ac04-bec7-444d-ba1c-5c4a4de9daf3'),(826,410,1,'Zonne-energie','zonne-energie',NULL,'{\"53b4730b-5a8f-454b-94d8-3be665156f06\": \"De zon als bron van schone energie\", \"9c48248e-ff56-4ca6-9204-d7514c9e2ac2\": [], \"f12615f5-6730-4501-9b90-2dc587567500\": \"<p>Zonne-energie is een onuitputtelijke, schone bron. Zonnepanelen zetten zonlicht om in elektriciteit. Hierbij komt geen CO₂ vrij. Dit betekent dat zonne-energie voor een duurzame toekomst een belangrijke energiebron is.  De opwek van energie door de zon is afhankelijk van het weer. </p>\", \"f6a174ef-6da7-4729-9d5f-8e128af1461a\": \"sun\"}',1,'2025-06-12 07:29:03','2025-06-12 07:47:27','f1402c79-5a73-40ed-b901-0bed1c2d0aeb'),(827,410,2,'Zonne-energie','zonne-energie',NULL,'{\"53b4730b-5a8f-454b-94d8-3be665156f06\": \"De zon als bron van schone energie\", \"9c48248e-ff56-4ca6-9204-d7514c9e2ac2\": [], \"f12615f5-6730-4501-9b90-2dc587567500\": \"<p>Zonne-energie is een onuitputtelijke, schone bron. Zonnepanelen zetten zonlicht om in elektriciteit. Hierbij komt geen CO₂ vrij. Dit betekent dat zonne-energie voor een duurzame toekomst een belangrijke energiebron is.  De opwek van energie door de zon is afhankelijk van het weer. </p>\", \"f6a174ef-6da7-4729-9d5f-8e128af1461a\": \"sun\"}',1,'2025-06-12 07:29:03','2025-06-12 07:47:28','06f28c2c-a105-4f19-ba60-b3c9b515fdda'),(828,411,1,'Zonne-energie','zonne-energie','nl/dataportaal/energie-productie/elektriciteit/zonne-energie',NULL,1,'2025-06-12 07:29:03','2025-06-12 07:29:03','2e1da622-cef8-4a10-ac34-b4ac89a5ae18'),(829,411,2,'Zonne-energie','zonne-energie','en/dataportaal/energie-productie/elektriciteit/zonne-energie',NULL,1,'2025-06-12 07:29:03','2025-06-12 07:29:03','06cccebd-9c1c-4ffa-925e-437c2a56c933'),(830,412,1,'Zonne-energie','zonne-energie',NULL,'{\"53b4730b-5a8f-454b-94d8-3be665156f06\": \"De zon als bron van schone energie\", \"f12615f5-6730-4501-9b90-2dc587567500\": \"<p>Zonne-energie is een onuitputtelijke, schone bron. Zonnepanelen zetten zonlicht om in elektriciteit. Hierbij komt geen CO₂ vrij. Dit betekent dat zonne-energie voor een duurzame toekomst een belangrijke energiebron is.  De opwek van energie door de zon is afhankelijk van het weer. </p>\", \"f6a174ef-6da7-4729-9d5f-8e128af1461a\": \"sun\"}',1,'2025-06-12 07:29:03','2025-06-12 07:29:03','3746201b-82cb-4f1e-9226-cb8cce1ba3ab'),(831,412,2,'Zonne-energie','zonne-energie',NULL,'{\"53b4730b-5a8f-454b-94d8-3be665156f06\": \"De zon als bron van schone energie\", \"f12615f5-6730-4501-9b90-2dc587567500\": \"<p>Zonne-energie is een onuitputtelijke, schone bron. Zonnepanelen zetten zonlicht om in elektriciteit. Hierbij komt geen CO₂ vrij. Dit betekent dat zonne-energie voor een duurzame toekomst een belangrijke energiebron is.  De opwek van energie door de zon is afhankelijk van het weer. </p>\", \"f6a174ef-6da7-4729-9d5f-8e128af1461a\": \"sun\"}',1,'2025-06-12 07:29:03','2025-06-12 07:29:03','b6b2c522-3732-4e3d-9efb-178886cd618c'),(852,423,1,'Overzichten productie zonne-energie','overzichten-productie-zonne-energie',NULL,'{\"4d3efb89-0e6f-4895-9545-fa3ee1bab78d\": \"<p>Deze pagina geeft inzicht in de productie van elektriciteit door zonnepanelen van vandaag, per maand en per jaar. Ook is een voorspelling opgenomen. Na het aanmaken van een <a href=\\\"https://ned.nl/user\\\">account</a> kun je diverse datasets downloaden of een API aanmaken.</p>\"}',1,'2025-06-12 08:05:51','2025-06-12 08:05:51','261a6a2b-3164-426a-90f8-7ca30d144053'),(853,423,2,'Overzichten productie zonne-energie','overzichten-productie-zonne-energie',NULL,'{\"4d3efb89-0e6f-4895-9545-fa3ee1bab78d\": \"<p>Deze pagina geeft inzicht in de productie van elektriciteit door zonnepanelen van vandaag, per maand en per jaar. Ook is een voorspelling opgenomen. Na het aanmaken van een <a href=\\\"https://ne