314'),(943,467,3,'Waarom is de CO₂ emissiefactor gelijk voor gas, terwijl deze van stroom wel fluctueert?','waarom-is-de-co₂-emissiefactor-gelijk-voor-gas-terwijl-deze-van-stroom-wel-fluctueert',NULL,'{\"d5ea52be-816b-4f8f-a079-97a6d2dbbc9c\": \"<p>Het aandeel van groen gas is nog beperkt en daarom fluctueert de emissiefactor nog maar beperkt bij gas. De verwachting is dat dit de komende jaren zal toenemen en meer zichtbaar zal gaan worden.</p>\"}',1,'2025-06-12 12:10:01','2025-06-12 12:10:01','592210d2-7956-4385-bc82-fa9f7097e76b'),(944,467,4,'Waarom is de CO₂ emissiefactor gelijk voor gas, terwijl deze van stroom wel fluctueert?','waarom-is-de-co₂-emissiefactor-gelijk-voor-gas-terwijl-deze-van-stroom-wel-fluctueert',NULL,'{\"d5ea52be-816b-4f8f-a079-97a6d2dbbc9c\": \"<p>Het aandeel van groen gas is nog beperkt en daarom fluctueert de emissiefactor nog maar beperkt bij gas. De verwachting is dat dit de komende jaren zal toenemen en meer zichtbaar zal gaan worden.</p>\"}',1,'2025-06-12 12:10:01','2025-06-12 12:10:01','b0934847-1ac4-4471-ba0c-6cc2a5a68321'),(945,468,1,'Over het Nationaal Energie Dashboard','ned-over-ons','nl/over-ned','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-06-12 12:34:26','2025-06-12 12:36:39','f38995b9-5e7c-4f10-b535-8ddd4ea3ed50'),(946,468,2,'About the National Energy Dashboard','ned-over-ons','en/about-ned','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-06-12 12:34:26','2025-06-12 12:37:20','743aa9fe-620b-4c1c-8912-89e587f12492'),(947,469,1,'NED - Over ons','ned-over-ons','nl/veelstgestelde-vragen','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-06-12 12:34:26','2025-06-12 12:36:10','31cefb1e-1b25-4d8c-9bfb-115812ce62e6'),(948,469,2,'NED - Over ons','ned-over-ons','en/about-ned','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2