p land</a></p><p><a href=\\\"https://ned.nl/node/75\\\">windenergie op zee</a></p><p><a href=\\\"https://ned.nl/nl/gasvraag\\\">gasvraag huishoudens en kleine bedrijven</a></p><p>Overzicht van <strong>opwek elektriciteit totaal en de verschillende elektriciteitsdragers</strong> is ook beschikbaar. Die vind je <a href=\\\"https://ned.nl/node/67\\\">hier. </a></p><p>Overzicht van de <strong>consumptie van gas en de verschillende gebruikersgroepen</strong> is ook beschikbaar. Die vind je <a href=\\\"https://ned.nl/node/68\\\">hier. </a></p><p>In de footer van onze website vind je een handig overzicht van de vijf meest gebruikte datasets voor <a href=\\\"https://ned.nl/popular-downloads/production/electricity\\\">elektriciteitsproductie</a> en <a href=\\\"https://ned.nl/popular-downloads/consumption/gas\\\">gasconsumptie</a>.</p><p>De CO₂-emissies zijn geen aparte dataset, maar zijn opgenomen in de datasets van de bronnen die CO₂-emissies hebben. </p>\"}',1,'2025-06-12 12:40:57','2025-06-12 12:40:57','ff986745-cc59-4be9-bdb5-4c0dc217f7f2'),(986,490,2,'Waar kan ik alle datasets vinden?','waar-kan-ik-alle-datasets-vinden',NULL,'{\"d5ea52be-816b-4f8f-a079-97a6d2dbbc9c\": \"<p>Bij ned.nl bieden we een scala aan datasets die je kunt verkennen in verschillende tijdresoluties, zoals per jaar, per maand, per dag, per uur of per kwartier.</p><p><strong>Voorspellende datasets</strong>, zeven dagen vooruit, zijn alleen beschikbaar voor:</p><p><a href=\\\"https://ned.nl/node/74\\\">zonne-energie</a></p><p><a href=\\\"https://ned.nl/node/73\\\">windenergie op land</a></p><p><a href=\\\"https://ned.nl/node/75\\\">windenergie op zee</a></p><p><a href=\\\"https://ned.nl/nl/gasvraag\\\">gasvraag huishoudens en kleine bedrijven</a></p><p>Overzicht van <strong>opwek elektriciteit totaal en de verschillende elektriciteitsdragers</strong> is ook beschikbaar. Die vind je <a href=\\\"https://ned.nl/node/67\\\">hier. </a></p><p>Overzicht van de <strong>consumptie van gas en de verschillende ge