455d-a8ff-ee6b6d29a8e8\": \"<p><strong>De CO₂ monitor is een website die op actuele basis inzicht geeft in de elektriciteits- en gasmix in Nederland en een indicatie geeft van de CO₂ emissies en emissiefactor van beide energiedragers.</strong></p><p>De CO₂ Monitor is een initiatief van <a href=\\\"https://gasunie.nl/\\\">Gasunie</a> en <a href=\\\"https://tennet.nl/\\\">TenneT</a> en wordt in opdracht ontwikkeld en beheerd door <a href=\\\"https://ned.nl/\\\">NED</a>. Beide landelijke netbeheerders vinden het belangrijk data transparant te maken voor iedereen werkzaam in de energietransitie.<br /><br />Ons energiesysteem wordt steeds complexer. Om de klimaatdoelen te behalen is het van belang meer inzicht te hebben in wanneer gas en stroom tot meer of minder CO₂ uitstoot leidt (de CO₂ arme uren).</p><p>Gasunie en TenneT willen laten zien dat naast prijs volatiliteit  ‘groene’ incentives mogelijk zijn om het complete energiesysteem zo duurzaam mogelijk in te zetten op ieder moment van de dag.</p>\"}',1,'2025-06-23 14:34:24','2025-06-23 14:34:24','570437c2-3de7-428a-85bd-cefb5c2ce04f'),(1460,727,4,'Wat is de CO₂ monitor','wat-is-de-co₂-monitor',NULL,'{\"06fb38c1-de32-455d-a8ff-ee6b6d29a8e8\": \"<p><strong>De CO₂ monitor is een website die op actuele basis inzicht geeft in de elektriciteits- en gasmix in Nederland en een indicatie geeft van de CO₂ emissies en emissiefactor van beide energiedragers.</strong></p><p>De CO₂ Monitor is een initiatief van <a href=\\\"https://gasunie.nl/\\\">Gasunie</a> en <a href=\\\"https://tennet.nl/\\\">TenneT</a> en wordt in opdracht ontwikkeld en beheerd door <a href=\\\"https://ned.nl/\\\">NED</a>. Beide landelijke netbeheerders vinden het belangrijk data transparant te maken voor iedereen werkzaam in de energietransitie.<br /><br />Ons energiesysteem wordt steeds complexer. Om de klimaatdoelen te behalen is het van belang meer inzicht te hebben in wanneer gas en stroom tot meer of minder CO₂ uitstoot leidt (de CO₂ arme uren).</p><p>Ga