ie opgewekt?</i></h6><p>Naar verhouding is de invloed van zonne-energie op de <a href=\\\"{entry:6@1:url||https://ned.nl/nl/dataportaal/energie-productie/elektriciteit/totale-elektriciteitsproductie}\\\">totale elektriciteitsproductie</a> het grootst in de voorjaar (maart, april, mei) en in de zomer (juni, juli, augustus). Dit komt doordat er langer en meer licht is en doordat de zon dan hoger aan de hemel staat.</p>\", \"318bed61-e89e-4de0-986a-2ac5f7c474cf\": \"<h6><i>Wat zie ik in de grafiek?</i></h6><p>De grafiek laat de productie van zonne-energie per maand zien. Uit de cijfers wordt duidelijk dat zonnepanelen ook energie leveren in de herfst en winter (september tot en met februari). Toch is de productie van zonne-energie in die seizoenen een stuk minder dan de periode van april tot en met september. Dit komt omdat er minder licht is en de zon lager aan de hemel staat.</p>\", \"59a4eb2d-3976-4008-af8e-49fd756f687e\": \"energyProductionSolarLastMonths\"}',1,'2025-06-26 12:03:59','2025-06-26 12:03:59','bba39c60-a219-4a2b-a131-8d36d5cb15d6'),(1484,739,4,'Productie elektriciteit per maand - zonne-energie','productie-elektriciteit-per-maand-zonne-energie',NULL,'{\"169a00e9-924f-465d-894e-40456e04be9b\": \"<h6><i>Wanneer wordt de meeste zonne-energie opgewekt?</i></h6><p>Naar verhouding is de invloed van zonne-energie op de <a href=\\\"{entry:6@1:url||https://ned.nl/nl/dataportaal/energie-productie/elektriciteit/totale-elektriciteitsproductie}\\\">totale elektriciteitsproductie</a> het grootst in de voorjaar (maart, april, mei) en in de zomer (juni, juli, augustus). Dit komt doordat er langer en meer licht is en doordat de zon dan hoger aan de hemel staat.</p>\", \"318bed61-e89e-4de0-986a-2ac5f7c474cf\": \"<h6><i>Wat zie ik in de grafiek?</i></h6><p>De grafiek laat de productie van zonne-energie per maand zien. Uit de cijfers wordt duidelijk dat zonnepanelen ook energie leveren in de herfst en winter (september tot en met februari). Toch is de productie van zonne-energie in die seizoenen een stuk minder dan de periode van april tot en met september. Dit komt omdat er minder licht is en de zon lager aan de hemel staat.</p>\", \"59a4eb2d-3976-4008-af8e-49fd756f687e\": \"energyProductionSolarLastMonths\"}',1,'2025-06-26 12:03:59','2025-06-26 12:03:59','645d32c8-ce30-4794-a95b-883c65bdae56'),(1485,740,3,'Co2 monitor - Co2 emissiefactor','co2-monitor-co2-emissiefactor-vandaag','nl',NULL,1,'2025-06-26 12:04:00','2025-06-26 12:04:00','52612b45-76d2-4226-9e2c-7f2ce95cfbb3'),(1486,740,4,'Co2 monitor - Co2 emissiefactor (vandaag)','co2-monitor-co2-emissiefactor-vandaag','en',NULL,1,'2025-06-26 12:04:00','2025-06-26 12:04:00','96676ec4-e9c3-48d9-a7d8-da0feddba328'),(1487,741,3,'CO2 Emissiefactor','co2-emissiefactor',NULL,'{\"4d3efb89-0e6f-4895-9545-fa3ee1bab78d\": \"<p>Een kleine intro op deze pagina. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque ac magna risus. Cras interdum facilisis nisi, in fermentum felis vestibulum vitae. Sed eu ante non sem tristique hendrerit quis vel dolor. Sed varius malesuada ipsum, varius condimentum nunc pretium eu. </p>\"}',1,'2025-06-26 12:04:00','2025-06-26 12:04:00','78223fd7-54d8-4f51-9596-983e1e2e7385'),(1488,741,4,'CO2 Emissiefactor','co2-emissiefactor',NULL,NULL,1,'2025-06-26 12:04:00','2025-06-26 12:04:00','ef1a4c32-6480-46cb-b848-d4baa07bfdf6'),(1489,742,3,'Zon 12 maanden','zon-12-maanden',NULL,NULL,1,'2025-06-26 12:04:00','2025-06-26 12:04:00','c8270e42-7385-4e01-a8c4-66434840629f'),(1490,742,4,'Zon 12 maanden','zon-12-maanden',NULL,NULL,1,'2025-06-26 12:04:00','2025-06-26 12:04:00','3eeef64c-79e3-4823-82c8-03683fe5a215'),(1491,743,3,'Productie elektriciteit per maand - zonne-energie','productie-elektriciteit-per-maand-zonne-energie',NULL,'{\"169a00e9-924f-465d-894e-40456e04be9b\": \"<h6><i>Wanneer wordt de meeste zonne-energie opgewekt?</i></h6><p>Naar verhouding is de invloed van zonne-energie op de <a href=\\\"{entry:6@1:url||https://ned.nl/nl/dataportaal/energie-productie/elektriciteit/totale-elektriciteitsproductie}\\\">totale elektriciteitsproductie</a> het grootst in de voorjaar (maart, april, mei) en in de zomer (juni, juli, augustus). Dit komt doordat er langer en meer licht is en doordat de zon dan hoger aan de hemel staat.</p>\", \"318bed61-e89e-4de0-986a-2ac5f7c474cf\": \"<h6><i>Wat zie ik in de grafiek?</i></h6><p>De grafiek laat de productie van zonne-energie per maand zien. Uit de cijfers wordt duidelijk dat zonnepanelen ook energie leveren in de herfst en winter (september tot en met februari). Toch is de productie van zonne-energie in die seizoenen een stuk minder dan de periode van april tot en met september. Dit komt omdat er minder licht is en de zon lager aan de hemel staat.</p>\", \"59a4eb2d-3976-4008-af8e-49fd756f687e\": \"energyProductionSolarLastMonths\"}',1,'2025-06-26 12:04:00','2025-06-26 12:04:00','1f254e3c-2760-4ef5-aee1-a82e83c46e2f'),(1492,743,4,'Productie elektriciteit per maand - zonne-energie','productie-elektriciteit-per-maand-zonne-energie',NULL,'{\"169a00e9-924f-465d-894e-40456e04be9b\": \"<h6><i>Wanneer wordt de meeste zonne-energie opgewekt?</i></h6><p>Naar verhouding is de invloed van zonne-energie op de <a href=\\\"{entry:6@1:url||https://ned.nl/nl/dataportaal/energie-productie/elektriciteit/totale-elektriciteitsproductie}\\\">totale elektriciteitsproductie</a> het grootst in de voorjaar (maart, april, mei) en in de zomer (juni, juli, augustus). Dit komt doordat er langer en meer licht is en doordat de zon dan hoger aan de hemel staat.</p>\", \"318bed61-e89e-4de0-986a-2ac5f7c474cf\": \"<h6><i>Wat zie ik in de grafiek?</i></h6><p>De grafiek laat de productie van zonne-energie per maand zien. Uit de cijfers wordt duidelijk dat zonnepanelen ook energie leveren in de herfst en winter (september tot en met februari). Toch is de productie van zonne-energie in die seizoenen een stuk minder dan de periode van april tot en met september. Dit komt omdat er minder licht is en de zon lager aan de hemel staat.</p>\", \"59a4eb2d-3976-4008-af8e-49fd756f687e\": \"energyProductionSolarLastMonths\"}',1,'2025-06-26 12:04:00','2025-06-26 12:04:00','f79a97f4-0e47-4788-b139-9d587b7c5814'),(1495,745,3,'Privacy statement','privacy-statement','nl/privacy-statement','{\"07b97bb6-b61e-402a-91e7-73cc34c76934\": \"<p>Het Nationaal Energie Dashboard vindt het belangrijk dat er goed met jouw gegevens wordt omgegaan. In ons privacy statement leggen we uit waarom, waarvoor, hoe lang en welke gegevens we verzamelen. Ook leggen we uit wat jij eraan kan doen als jij het hier niet mee eens bent.</p><p><strong>Wat verzamelen we van jou en waarom?</strong></p><p>Welke gegevens wij van jou verzamelen hangt af van wat jij met Het Nationaal Energie Dashboard doet. Je bezoekt bijvoorbeeld onze website, bent geabonneerd op onze nieuwsbrief of je hebt een account. </p><p>Wat je ook komt doen: we verzamelen alleen gegevens die echt nodig zijn om het werk goed uit te kunnen voeren. We gaan dan ook altijd vertrouwelijk met jouw gegevens om en delen jouw gegevens niet met derden.</p><p>De verwerking van persoonsgegevens gebeurt op een wijze, die in overeenstemming is met de wet AVG (Algemene Verordening Gegevensbescherming). Hieronder sommen wij op wat wij van jou verzamelen.</p><p><i><strong>Heb je een account?</strong></i></p><p>Als je een account hebt bij Het Nationaal Energie Dashboard, dan kan je toegang krijgen tot de data. Wij verzamelen dan de volgende gegevens:</p><p>Jouw naam: zodat we weten wie gebruik maakt van de data en ook zodat we contact kunnen opnemen over onze dienstverlening, indien nodig. </p><p>E-mailadres: zodat we je kunnen mailen wanneer dat nodig is, bijvoorbeeld om de API key door te geven of updates in onze systemen aan te kondigen.</p><p>Gebruiksdoel: zodat we inzicht krijgen waarvoor je de energiedata wilt gebruiken. Dit kan ons helpen in verdere doorontwikkeling. </p><p>Bedrijfsnaam: zodat we weten welke bedrijven gebruik maken van onze energiedata. Het doorgeven van de bedrijfsnaam is optioneel. </p><p>Bij het aanmaken van het account ga je akkoord met onze <a href=\\\"https://ned.nl/nl/algemene-voorwaarden\\\">algemene voorwaarden</a>. </p><p><i><strong>Bezoek je onze website?</strong></i></p><p>Op onze website hebben we cookies. Wij gebruiken verschillende cookies die ervoor zorgen dat jouw bezoek aan onze website prettiger en makkelijker wordt en wij onze service nog beter op jouw wensen kunnen aanpassen.</p><p>Goed om te weten: wij verzamelen via cookies nooit persoonlijke informatie, zoals je naam, jouw telefoonnummer of e-mailadres. De data wordt niet aan derden verstrekt en voor analyse gebruiken wij alleen geanonimiseerde gegevens.</p><p>Voor het plaatsen van bepaalde cookies hebben wij jouw toestemming nodig. We vragen je toestemming wanneer je onze website bezoekt. Door op accepteren te klikken geef je via een actieve handeling (een opt-in) toestemming voor het plaatsen van cookies. Deze cookies passen we toe:</p><p><i>Functionele cookies</i><br />Verhogen het gebruikersgemak. Hierbij kan je denken aan bijvoorbeeld het onthouden van informatie die je invult en het herkennen van jouw browserinstellingen om onze website optimaal op je beeldscherm te kunnen weergeven.</p><p><i>Analytische cookies</i><br />Houden geanonimiseerd webstatistieken bij. We zien bijvoorbeeld dat een webpagina driehonderd keer is bekeken, maar niet door wie. Met deze informatie kunnen we onze website nog beter inrichten. </p><p><i>Tracking cookies</i><br />Volgen jouw online gedrag, zodat we weten wat je interessant vindt. Met deze informatie kunnen we je zo relevant mogelijke content aanbieden én kunnen we voorkomen dat je te vaak dezelfde content ziet.</p><p><i>Socialmedia-cookies</i><br />Als je klikt op socialmedia-buttons op onze website, bijvoorbeeld om een nieuwsitem te delen op LinkedIn, kan het zijn dat deze media cookies plaatsen op jouw device of pc. Hier zijn de voorwaarden van het desbetreffende socialmedia-kanaal zelf van toepassing.</p><p><i>Wilt je dat we geen cookies verzamelen?</i><br />Dat kan. Wij vragen als je onze website bezoekt actief of we cookies mogen verzamelen. Je kunt dan ook aangeven dat je dit niet wilt. Alternatief is dat je het niet verzamelen van cookies ook kan doorgeven via de instellingen van jouw browser.  </p><p><i><strong>Ontvang je onze nieuwsbrief?</strong></i></p><p>Dan hebben we alleen je e-mailadres en naam nodig. Jouw e-mailadres wordt alleen met expliciete toestemming toegevoegd aan onze lijst van nieuwsbrief abonnees. Je kunt je online inschrijven. Vervolgens ontvang je een bevestigingsmail om jouw inschrijving te activeren, dit heet ook wel een dubbele opt-in. Alleen als je al een account hebt aangemaakt, ontvang je geen bevestigingsmail. Je wordt dan rechtstreeks ingeschreven. En uiteraard bevat iedere nieuwsbrief ook een link waarmee je je weer kunt afmelden. Via de nieuwsbrief kun je ook zelf jouw gegevens beheren. Heb je hier toch vragen over, dan kun je altijd contact met ons opnemen met <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl.</a></p><p><i><strong>Ontvang je onze servicemails?</strong></i></p><p>Servicemails kunnen wij sturen naar accounthouders op het Nationaal Energie Dashboard. We maken onderscheid tussen servicemails die noodzakelijk zijn voor onze dienstverlening en nieuwsbrieven. </p><p>Servicemails die noodzakelijk zijn voor onze dienstverlening zijn bijvoorbeeld mailings met aankondiging van een update van de capaciteiten of onderhoudswerkzaamheden. Voor dit soort e-mails kun je je niet afmelden, omdat ze onderdeel zijn van onze dienstverlening.</p><p>Voor nieuwsbrieven geef je wel toestemming. Dit zijn bijvoorbeeld e-mails waarmee we je attenderen op nieuwe features of mogelijke uitbreidingen. Mocht je deze niet meer willen ontvangen, dan kun je dat aangeven via de link van de nieuwsbrief.</p><p><i><strong>Volg je ons?</strong></i></p><p>Dat vinden we leuk! Als je ons volgt op social media (X en LinkedIn) dan gelden de privacy-overeenkomsten van deze media zelf. Je kunt daar inloggen om jouw instellingen aan te passen.</p><p><strong>Bewaartermijn</strong></p><p>Het Nationaal Energie Dashboard verwijdert jouw persoonsgegevens zodra de wettelijke bewaartermijn is verlopen. Indien er geen wettelijke bewaartermijn is gedefinieerd, verwijderen wij jouw persoonsgegevens zodra de persoonsgegevens niet langer relevant zijn. Je kunt met vragen over een specifieke bewaartermijn voor bepaalde soorten persoonsgegevens een e-mail sturen aan <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>.</p><p><strong>Beveiliging</strong></p><p>Het Nationaal Energie Dashboard gebruikt passende technische, veiligheids- en organisatorische maatregelen om persoonsgegevens te beschermen en te helpen voorkomen dat diefstal, misbruik en onbevoegde toegang, verstrekking, wijziging en vernietiging van informatie kunnen plaatsvinden. Het Nationaal Energie Dashboard bewaart de persoonsgegevens bijvoorbeeld op computersystemen met beperkte toegang en in gecontroleerde omgevingen. Persoonsgegevens worden op een beveiligde manier opgeslagen op gecontracteerde servers in de EU.</p><p><strong>Wil je je gegevens inzien?</strong></p><p>Wil je je gegevens inzien, dan kun je contact met ons opnemen via <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>. Wij zullen zo snel mogelijk contact met je opnemen. We verstrekken informatie binnen een maand na ontvangst van jouw verzoek. Mocht je een complex verzoek hebben of juist een veelvoud aan verzoeken, dan kunnen wij deze termijn verlengen met twee maanden. Als dit het geval is, laten we jou dit weten.</p><p><strong>Welke gegevens kun je inzien?</strong></p><p>Je hebt het:</p><p>Recht op informatie over de verwerkingen: wat gebeurt er met je persoonsgegevens en waarom?</p><p>Recht op inzage: je heeft het recht het Nationaal Energie Dashboard te verzoeken om te laten zien of het Nationaal Energie Dashboard jouw persoonsgegevens verwerkt, en zo ja, welke dan.</p><p>Recht op rectificatie: het Nationaal Energie Dashboard moet zorgen dat de gebruikte persoonsgegevens accuraat zijn en blijven. Je mag het Nationaal Energie Dashboard verzoeken om gegevens te corrigeren of aan te vullen.</p><p>Recht op vergetelheid: je hebt het recht het Nationaal Energie Dashboard te verzoeken om verwijdering van jouw persoonsgegevens. Het is dan aan het Nationaal Energie Dashboard om te bepalen of dat verzoek gerechtvaardigd is. Dit kan het geval zijn als de persoonsgegevens niet langer nodig zijn voor de doeleinden waarvoor deze zijn verwerkt of de persoonsgegevens onrechtmatig zijn verwerkt.</p><p>Recht op beperking van de verwerking: je hebt het recht het Nationaal Energie Dashboard te verzoeken de verwerking te beperken, bijvoorbeeld als de gegevens onjuist zijn of de verwerking onrechtmatig is.</p><p>Recht van bezwaar: je hebt het recht om met jouw specifieke situatie verband houdende redenen bezwaar te maken tegen verwerking van je persoonsgegevens. Het Nationaal Energie Dashboard staakt de verwerking tenzij er dwingende gerechtvaardigde gronden bestaan voor de verwerking die zwaarder wegen dan jouw belangen, rechten en vrijheden.</p><p><strong>Toestemming</strong></p><p>Je hebt toestemming gegeven om jouw persoonsgegevens te gebruiken. Je hebt te allen tijde het recht om deze toestemming in te trekken.</p><p><strong>Wijzigingen aan onze privacy statement</strong></p><p>Het Nationaal Energie Dashboard kan deze privacy statement indien nodig aanpassen. Het is daarom aan te raden geregeld op de website van het Nationaal Energie Dashboard te kijken voor de meest recente versie. Als het Nationaal Energie Dashboard de privacy statement bijwerkt, zal het Nationaal Energie Dashboard de datum achter \'Laatst bijgewerkt\' onderaan de privacy statement aanpassen. </p><p><strong>Klacht?</strong></p><p>Het Nationaal Energie Dashboard probeert altijd om met jou samen te werken om een eerlijke oplossing te vinden als je een klacht hebt over of een probleem heeft met het gebruik van jouw persoonsgegevens. Je kunt een klacht indienen via <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>.</p><p>Kom je er samen met ons niet uit, dan kun je je klacht indienen bij de <a href=\\\"https://autoriteitpersoonsgegevens.nl/nl/zelf-doen/gebruik-uw-privacyrechten/klacht-melden-bij-de-ap\\\">Autoriteit Persoonsgegevens</a>. De Autoriteit Persoonsgegevens houdt toezicht op het gebruik van persoonsgegevens.</p><p><strong>Contact</strong></p><p>Voor vragen over het gebruik van persoonsgegevens kun je een e-mail sturen aan <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>. </p><p><i>Laatst bijgewerkte versie 25 maart 2024</i></p>\", \"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:17:43','2025-07-01 08:21:08','bac05d91-68bc-4a00-8a68-46d2d663939e'),(1496,745,4,'Privacy statement','privacy-statement','en/privacy-statement','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:17:43','2025-07-01 08:18:08','9a16647b-3915-4d99-a0c7-c09a9a860b99'),(1497,746,3,'Privacy statement','privacy-statement','nl/privacy-statement','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:17:43','2025-07-01 08:18:08','33ea1156-8b15-46cf-8ff3-ad25fe21541b'),(1498,746,4,'Privacy statement','privacy-statement','en/privacy-statement','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:17:43','2025-07-01 08:18:08','63805d70-0535-42d2-9443-52e69e90e008'),(1499,747,3,'Privacy statement','privacy-statement','nl/privacy-statement','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:18:08','2025-07-01 08:18:08','dd633003-3f38-419f-a56f-120891f72024'),(1500,747,4,'Privacy statement','privacy-statement','en/privacy-statement','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-