5ed9d63-bc90-48fe-a52e-034261f870f8'),(1504,749,4,'Disclaimer','disclaimer','en/disclaimer',NULL,1,'2025-07-01 08:18:54','2025-07-01 08:18:54','df0566c6-b930-4749-96e5-5995194f7731'),(1505,750,3,'Privacy statement','privacy-statement','nl/privacy-statement','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:19:06','2025-07-01 08:19:06','a1777423-26f3-405a-ba66-dbb90bbe5bae'),(1506,750,4,'Privacy statement','privacy-statement','en/privacy-statement','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:19:06','2025-07-01 08:19:06','56df7402-1457-45d8-a894-2ecc57fa4f78'),(1507,751,3,'Algemene Voorwaarden Nationaal Energie Dashboard','algemene-voorwaarden','nl/algemene-voorwaarden','{\"07b97bb6-b61e-402a-91e7-73cc34c76934\": \"<p><i>Versie d.d. 01-01-2024</i><br /><br /><strong>Artikel 1 Definities</strong><br />1.1) “API”: de Application Programming Interface van Nationaal Energie Dashboard.<br /><br />1.2) “Gebruiker”: de gebruiker van het Product.<br /><br />1.3) “IE-rechten”:  alle (i) intellectuele eigendomsrechten, daaronder begrepen merken en andere herkomstaanduidingen, octrooien, auteursrechten, persoonlijkheidsrechten en databankrechten, ongeacht of deze geregistreerd zijn of vatbaar voor registratie, met inbegrip van aanvragen voor registratie daarvan, aanspraken op een en ander, of verwante rechten, zoals prioriteitsrechten en (voor)gebruiksrechten en rechten op bescherming of aanspraken van gelijke strekking waar ook ter wereld, en (ii) bedrijfsgeheimen en aanspraken op vertrouwelijkheid, daaronder begrepen rechten met betrekking tot uitvindingen, know-how en andere vertrouwelijke informatie en data.<br /><br />1.4) “Nationaal Energie Dashboard”: National Energy Information Services B.V. h.o.d.n. Nationaal Energie Dashboard, kantoorhoudend te Groningen, aan de Concourslaan 17, postcode 9727KC met KvK nummer: 91779324.<br /><br />1.5) “Product”: een benadering van de energiemix voor zowel (duurzame) productie als consumptie in Nederland, overeenkomstig de Overeenkomst. Het Product kan in de vorm bestaan van een beschikbaarheid van of een combinatie van vormen van een API en/of download.<br /><br />1.6) “Overeenkomst(en)”: elke overeenkomst tussen Partijen met betrekking tot het verrichten van Diensten als bedoeld in artikel 3 ten aanzien van alsmede het gebruik van het Product.<br /><br />1.7) “Partijen”: Nationaal Energie Dashboard en Gebruiker.<br /><br />1.8) “API key”: een unieke sleutel die de Gebruiker toegang geeft tot de API.<br /><br /><strong>Artikel 2 Toepasselijkheid</strong><br />2.1) Deze Algemene Voorwaarden beheersen de rechtsverhouding tussen Partijen en zijn steeds van toepassing op alle rechtshandelingen van Partijen met betrekking tot de totstandkoming en uitvoering van de Overeenkomst(en), alsmede op het gebruik van (inclusief toegang tot) het Product. Door gebruik van het Product, ook na beëindiging van de Overeenkomst, gaat de Gebruiker akkoord met deze Algemene Voorwaarden. Indien Gebruiker niet akkoord gaat met deze Algemene Voorwaarden, is het Gebruiker niet toegestaan het Product te gebruiken en/of enige inhoud te openen.<br /><br /><strong>Artikel 3 Diensten</strong><br />3.1) Nationaal Energie Dashboard verricht activiteiten op het gebied van het uitlezen, opslaan, interpoleren, aggregeren en benaderen van (verwachte) beschikbare (duurzame) energiegegevens, en wil deze gegevens of een uitwerking daarvan aanbieden aan de markt ten behoeve van kennisvoorziening. Nationaal Energie Dashboard biedt voornoemde aan in de vorm van data via een API en/of een download.<br /><br />3.2) Nationaal Energie Dashboard zal het Product gedurende de looptijd van de Overeenkomst beschikbaar stellen aan Gebruiker voor het beoogde gebruik, mits Gebruiker aan deze Algemene Voorwaarden voldoet.<br /><br />3.3) Nationaal Energie Dashboard zal het Product naar redelijkheid up-to-date houden. Gebruiker vrijwaart Nationaal Energie Dashboard van claims betreffende directe of indirecte kosten die ontstaan aan de zijde van Gebruiker door aanpassingen die Nationaal Energie Dashboard uitvoert op zijn Product. <br /><br />3.4) Bij beëindiging van de Overeenkomst dient Gebruiker het Product te verwijderen. Dit geldt niet voor de data die via de download is verkregen.<br /><br />3.5) De verstrekte API key is alleen voor de Gebruiker en mag niet openbaar gedeeld worden. Het is toegestaan om de API key te delen met een IT dienstenleverancier ten behoeve van het in de Overeenkomst beschreven doel. Gebruiker staat er voor in (en is daarvoor verantwoordelijk) dat een dergelijke IT dienstenleverancier de API key niet anders gebruikt dan voor het in de Overeenkomst omschreven doel. <br /><br />3.6) Het kopiëren, distribueren of anderzijds verkopen aan derden van het door Nationaal Energie Dashboard aan Gebruiker verstrekte Product is niet toegestaan zonder voorafgaande toestemming van Nationaal Energie Dashboard. Deze toestemming kan alleen in nadere overeenstemming met het Nationaal Energie Dashboard in een aparte overeenkomst verleend worden. <br /><br />3.7) Het gebruik van de API zal zoveel mogelijk beperkt worden tot de frequentie waarop de data door Nationaal Energie Dashboard beschikbaar wordt gesteld voor de Gebruiker, als nader omschreven in de Overeenkomst. Slechts enkel voor de inrichting van de software van de Gebruiker die de API aanroept mag deze vaker worden gebruikt. <br /><br />3.8) Bij vermoeden van verkeerd gebruik is Nationaal Energie Dashboard gerechtigd de toegang tot het Product te weigeren, zonder enige vorm van aansprakelijkheid te accepteren voor schade ontstaan bij Gebruiker ten gevolge van de geweigerde toegang. Nationaal Energie Dashboard kan daaropvolgend besluiten de Diensten aan Gebruiker en/of haar groepsmaatschappijen onverwijld te beëindigen. <br /><br /><strong>Artikel 4 Vergoeding </strong><br />4.1) Nationaal Energie Dashboard verleent Gebruiker kosteloos toegang tot het Product. <br /><br />4.2) Nationaal Energie Dashboard behoudt zich het recht voor om gedurende de looptijd van de Overeenkomst(en), de vergoeding voor het Product, met inachtneming van artikel 9, te wijzigen.<br /><br /><strong>Artikel 5 Communicatie </strong><br />5.1) De Gebruiker zal bij de totstandkoming van de Overeenkomst(en) één of meerdere geldige e-mailadressen opgeven aan Nationaal Energie Dashboard. De Gebruiker stemt ermee in dat Nationaal Energie Dashboard via de opgegeven e-mailadressen met de Gebruiker communiceert (over onder meer de uitvoering van de Overeenkomst(en)). Wijzigingen in de te gebruiken e-mailadressen dienen tijdig door de Gebruiker aan Nationaal Energie Dashboard te worden gemeld. <br /><br />5.2) De Gebruiker stemt bij het afgeven van één of meerdere geldige e-mailadressen ermee in dat Nationaal Energie Dashboard contact mag opnemen voor vragen met betrekking tot het gebruik van de data. <br /><br />5.3) De Gebruiker is zelf verantwoordelijk voor een correcte opgave van één of meerdere e-mailadressen. Tevens is de Gebruiker zelf verantwoordelijk voor bevoegd en adequaat gebruik van de opgegeven e-mailadressen. Nationaal Energie Dashboard is niet aansprakelijk voor schade die voortvloeit uit onjuist opgegeven e-mailadressen of inadequaat of onbevoegd gebruik van de opgegeven e-mailadressen.   <br /><br /><strong>Artikel 6 Duur en beëindiging </strong></p><p>6.1) Partijen hebben het recht om de Overeenkomst op te zeggen, de Gebruiker zonder opzegtermijn en Nationaal Energie Dashboard met inachtneming van een opzegtermijn van dertig kalenderdagen. <br /><br />6.2) Als de Gebruiker minstens zes maanden geen gebruik maakt van de API key, dan heeft Nationaal Energie Dashboard het recht om de toegang tot het Product en de Overeenkomst met onmiddellijke ingang te beëindigen. <br /><br />6.3) Als Nationaal Energie Dashboard van mening is dat zij op grond van de Gaswet, Elektriciteitswet 1998 of andere relevante regelgeving niet langer partij kan zijn bij de Overeenkomst en/of het Product beschikbaar kan stellen, dan heeft Nationaal Energie Dashboard het recht om de Overeenkomst en de toegang tot het Product met onmiddellijke ingang te beëindigen, zonder dat Nationaal Energie Dashboard enige vorm van kosten- of schadevergoeding verschuldigd zal zijn. <br /><br /><strong>Artikel 7 Aansprakelijkheid </strong><br />7.1) Ondanks dat de verstrekte data zorgvuldig worden samengesteld blijft het een inschatting waarvoor Nationaal Energie Dashboard geen enkele aansprakelijkheid kan aanvaarden ten aanzien van de volledigheid, juistheid en/of tijdigheid. <br /><br />7.2) Nationaal Energie Dashboard en onderaannemers zijn niet aansprakelijk voor enige schade (direct of indirect) voortvloeiend uit enig gebruik van de gegevens en/of het Product die beschikbaar zijn gesteld. <br /><br />7.3) De Gebruiker vrijwaart Nationaal Energie Dashboard en zijn toeleveranciers van eventuele claims (van derden) voor het gebruik van het Product.<br /><br /><strong>Artikel 8 Intellectuele eigendomsrechten </strong><br />8.1) Alle IE-Rechten van het Product berusten uitsluitend bij Nationaal Energie Dashboard of diens licentiegevers. De Gebruiker krijgt uitsluitend het recht het Product te gebruiken voor het doel overeenkomstig de Overeenkomst. Dit gebruiksrecht is niet-exclusief en niet overdraagbaar aan derden. Tevens mag de Gebruiker geen (sub)licentie(s) verstrekken. <br /><br />8.2) De Gebruiker is verplicht om bij gebruik van het Product bronvermelding te hanteren in de vorm van het logo van Nationaal Energie Dashboard en een link naar de website van Nationaal Energie Dashboard op te nemen. <br /><br />8.3) De eventueel aangeleverde capaciteit- en productiegegevens en de bewerkte gegevens blijven eigendom van de partij die ze heeft aangeleverd. Voornoemde gegevens zullen enkel geanonimiseerd aangeleverd worden en mogen geen persoonsgegevens bevatten. Nationaal Energie Dashboard behoudt zich het recht voor om deze gegevens in te zetten voor het duurzaam verbeteren van haar diensten. Tevens kunnen de geleverde gegevens in anonieme vorm onderdeel vormen van andere verstrekkingen door Nationaal Energie Dashboard en eventuele toeleveranciers zonder voorafgaand toestemming van de partij.<br /><br />8.4) De Gebruiker stemt er mee in dat Nationaal Energie Dashboard het logo van de Gebruiker (voor zover een bedrijf of instelling) op de website van Nationaal Energie Dashboard mag plaatsen. Indien vermelding van het logo niet (meer) gewenst is, zal de Gebruiker contact opnemen met Nationaal Energie Dashboard met een verzoek tot verwijdering van het logo. <br /><br /><strong>Artikel 9 Overig </strong><br />9.1) Nationaal Energie Dashboard is gerechtigd deze Algemene Voorwaarden te wijzigen indien en wanneer naar het redelijke oordeel van Nationaal Energie Dashboard een dergelijke wijziging noodzakelijk is. Nationaal Energie Dashboard zal de Gebruiker op redelijke wijze en ten minste een maand voor de wijzigingen van kracht worden op de hoogte brengen van de gewijzigde voorwaarden. <br /><br />9.2) Het ongeldig verklaren van een bepaling uit deze Algemene Voorwaarden zal geen effect hebben op de geldigheid van de andere in deze Algemene Voorwaarden opgenomen bepalingen. <br /><br />9.3) Overdracht van rechten/of verplichtingen uit de Overeenkomst door de Gebruiker aan derden is niet toegestaan zonder voorafgaande schriftelijke goedkeuring van Nationaal Energie Dashboard, welke toestemming niet op onredelijke gronden kan worden onthouden. <br /><br />9.4) Partijen zijn en blijven van elkaar onafhankelijke contractanten; de tot stand gekomen of te komen Overeenkomst is geenszins een partnership, een joint venture of enige andere vennootschapsrechtelijke samenwerking tussen Partijen. <br /><br /><strong>Artikel 10 Toepasselijk recht en forumkeuze </strong><br />10.1) Op de Overeenkomst en deze Algemene Voorwaarden is Nederlands recht van toepassing. <br /><br />10.2) Bij eventuele geschillen zullen Partijen dit eerst in onderling overleg trachten op te lossen. Wanneer dit niet lukt zal de rechtbank van Groningen uitsluitend bevoegd zijn over geschillen voortvloeiende uit of ter zake van de Overeenkomst en/of de Algemene Voorwaarden uitspraak te doen. <br /><br /><i>Algemene Voorwaarden NEIS BV 01-01-2024 </i><br /><br /><br /><br /><strong>Een Engelse vertaling van deze voorwaarden is op </strong><a href=\\\"https://ned.nl/nl/contact\\\"><strong>aanvraag</strong></a><strong> verkrijgbaar.</strong></p>\", \"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:20:31','2025-07-01 08:22:36','9e9ab050-3d03-45b0-bc3d-8f44d858956a'),(1508,751,4,'Algemene voorwaarden','algemene-voorwaarden','en/terms-and-conditions','{\"7c843788-02f0-420d-98ae-a9a4bf15fff8\": [], \"ca8ea97c-d3f6-41b2-a020-542686118a81\": []}',1,'2025-07-01 08:20:31','2025-07-01 08:22:36','5abfd41d-78f4-4a7d-965b-34b8ab16502a'),(1509,752,3,'Algemene voorwaarden','algemene-voorwaarden','nl/algemene-voorwaarden',NULL,1,'2025-07-01 08:20:31','2025-07-01 08:20:31','4a54a137-7ad1-4542-93ec-b902baeb1528'),(1510,752,4,'Algemene voorwaarden','algemene-voorwaarden','en/terms-and-conditions',NULL,1,'2025-07-01 08:20:31','2025-07-01 08:20:31','725fe84f-c522-4c3f-a7bc-780891522ee6'),(1513,754,3,'Privacy statement','privacy-statement','nl/privacy-statement','{\"07b97bb6-b61e-402a-91e7-73cc34c76934\": \"<p>Het Nationaal Energie Dashboard vindt het belangrijk dat er goed met jouw gegevens wordt omgegaan. In ons privacy statement leggen we uit waarom, waarvoor, hoe lang en welke gegevens we verzamelen. Ook leggen we uit wat jij eraan kan doen als jij het hier niet mee eens bent.</p><p><strong>Wat verzamelen we van jou en waarom?</strong></p><p>Welke gegevens wij van jou verzamelen hangt af van wat jij met Het Nationaal Energie Dashboard doet. Je bezoekt bijvoorbeeld onze website, bent geabonneerd op onze nieuwsbrief of je hebt een account. </p><p>Wat je ook komt doen: we verzamelen alleen gegevens die echt nodig zijn om het werk goed uit te kunnen voeren. We gaan dan ook altijd vertrouwelijk met jouw gegevens om en delen jouw gegevens niet met derden.</p><p>De verwerking van persoonsgegevens gebeurt op een wijze, die in overeenstemming is met de wet AVG (Algemene Verordening Gegevensbescherming). Hieronder sommen wij op wat wij van jou verzamelen.</p><p><i><strong>Heb je een account?</strong></i></p><p>Als je een account hebt bij Het Nationaal Energie Dashboard, dan kan je toegang krijgen tot de data. Wij verzamelen dan de volgende gegevens:</p><p>Jouw naam: zodat we weten wie gebruik maakt van de data en ook zodat we contact kunnen opnemen over onze dienstverlening, indien nodig. </p><p>E-mailadres: zodat we je kunnen mailen wanneer dat nodig is, bijvoorbeeld om de API key door te geven of updates in onze systemen aan te kondigen.</p><p>Gebruiksdoel: zodat we inzicht krijgen waarvoor je de energiedata wilt gebruiken. Dit kan ons helpen in verdere doorontwikkeling. </p><p>Bedrijfsnaam: zodat we weten welke bedrijven gebruik maken van onze energiedata. Het doorgeven van de bedrijfsnaam is optioneel. </p><p>Bij het aanmaken van het account ga je akkoord met onze <a href=\\\"https://ned.nl/nl/algemene-voorwaarden\\\">algemene voorwaarden</a>. </p><p><i><strong>Bezoek je onze website?</strong></i></p><p>Op onze website hebben we cookies. Wij gebruiken verschillende cookies die ervoor zorgen dat jouw bezoek aan onze website prettiger en makkelijker wordt en wij onze service nog beter op jouw wensen kunnen aanpassen.</p><p>Goed om te weten: wij verzamelen via cookies nooit persoonlijke informatie, zoals je naam, jouw telefoonnummer of e-mailadres. De data wordt niet aan derden verstrekt en voor analyse gebruiken wij alleen geanonimiseerde gegevens.</p><p>Voor het plaatsen van bepaalde cookies hebben wij jouw toestemming nodig. We vragen je toestemming wanneer je onze website bezoekt. Door op accepteren te klikken geef je via een actieve handeling (een opt-in) toestemming voor het plaatsen van cookies. Deze cookies passen we toe:</p><p><i>Functionele cookies</i><br />Verhogen het gebruikersgemak. Hierbij kan je denken aan bijvoorbeeld het onthouden van informatie die je invult en het herkennen van jouw browserinstellingen om onze website optimaal op je beeldscherm te kunnen weergeven.</p><p><i>Analytische cookies</i><br />Houden geanonimiseerd webstatistieken bij. We zien bijvoorbeeld dat een webpagina driehonderd keer is bekeken, maar niet door wie. Met deze informatie kunnen we onze website nog beter inrichten. </p><p><i>Tracking cookies</i><br />Volgen jouw online gedrag, zodat we weten wat je interessant vindt. Met deze informatie kunnen we je zo relevant mogelijke content aanbieden én kunnen we voorkomen dat je te vaak dezelfde content ziet.</p><p><i>Socialmedia-cookies</i><br />Als je klikt op socialmedia-buttons op onze website, bijvoorbeeld om een nieuwsitem te delen op LinkedIn, kan het zijn dat deze media cookies plaatsen op jouw device of pc. Hier zijn de voorwaarden van het desbetreffende socialmedia-kanaal zelf van toepassing.</p><p><i>Wilt je dat we geen cookies verzamelen?</i><br />Dat kan. Wij vragen als je onze website bezoekt actief of we cookies mogen verzamelen. Je kunt dan ook aangeven dat je dit niet wilt. Alternatief is dat je het niet verzamelen van cookies ook kan doorgeven via de instellingen van jouw browser.  </p><p><i><strong>Ontvang je onze nieuwsbrief?</strong></i></p><p>Dan hebben we alleen je e-mailadres en naam nodig. Jouw e-mailadres wordt alleen met expliciete toestemming toegevoegd aan onze lijst van nieuwsbrief abonnees. Je kunt je online inschrijven. Vervolgens ontvang je een bevestigingsmail om jouw inschrijving te activeren, dit heet ook wel een dubbele opt-in. Alleen als je al een account hebt aangemaakt, ontvang je geen bevestigingsmail. Je wordt dan rechtstreeks ingeschreven. En uiteraard bevat iedere nieuwsbrief ook een link waarmee je je weer kunt afmelden. Via de nieuwsbrief kun je ook zelf jouw gegevens beheren. Heb je hier toch vragen over, dan kun je altijd contact met ons opnemen met <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl.</a></p><p><i><strong>Ontvang je onze servicemails?</strong></i></p><p>Servicemails kunnen wij sturen naar accounthouders op het Nationaal Energie Dashboard. We maken onderscheid tussen servicemails die noodzakelijk zijn voor onze dienstverlening en nieuwsbrieven. </p><p>Servicemails die noodzakelijk zijn voor onze dienstverlening zijn bijvoorbeeld mailings met aankondiging van een update van de capaciteiten of onderhoudswerkzaamheden. Voor dit soort e-mails kun je je niet afmelden, omdat ze onderdeel zijn van onze dienstverlening.</p><p>Voor nieuwsbrieven geef je wel toestemming. Dit zijn bijvoorbeeld e-mails waarmee we je attenderen op nieuwe features of mogelijke uitbreidingen. Mocht je deze niet meer willen ontvangen, dan kun je dat aangeven via de link van de nieuwsbrief.</p><p><i><strong>Volg je ons?</strong></i></p><p>Dat vinden we leuk! Als je ons volgt op social media (X en LinkedIn) dan gelden de privacy-overeenkomsten van deze media zelf. Je kunt daar inloggen om jouw instellingen aan te passen.</p><p><strong>Bewaartermijn</strong></p><p>Het Nationaal Energie Dashboard verwijdert jouw persoonsgegevens zodra de wettelijke bewaartermijn is verlopen. Indien er geen wettelijke bewaartermijn is gedefinieerd, verwijderen wij jouw persoonsgegevens zodra de persoonsgegevens niet langer relevant zijn. Je kunt met vragen over een specifieke bewaartermijn voor bepaalde soorten persoonsgegevens een e-mail sturen aan <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>.</p><p><strong>Beveiliging</strong></p><p>Het Nationaal Energie Dashboard gebruikt passende technische, veiligheids- en organisatorische maatregelen om persoonsgegevens te beschermen en te helpen voorkomen dat diefstal, misbruik en onbevoegde toegang, verstrekking, wijziging en vernietiging van informatie kunnen plaatsvinden. Het Nationaal Energie Dashboard bewaart de persoonsgegevens bijvoorbeeld op computersystemen met beperkte toegang en in gecontroleerde omgevingen. Persoonsgegevens worden op een beveiligde manier opgeslagen op gecontracteerde servers in de EU.</p><p><strong>Wil je je gegevens inzien?</strong></p><p>Wil je je gegevens inzien, dan kun je contact met ons opnemen via <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>. Wij zullen zo snel mogelijk contact met je opnemen. We verstrekken informatie binnen een maand na ontvangst van jouw verzoek. Mocht je een complex verzoek hebben of juist een veelvoud aan verzoeken, dan kunnen wij deze termijn verlengen met twee maanden. Als dit het geval is, laten we jou dit weten.</p><p><strong>Welke gegevens kun je inzien?</strong></p><p>Je hebt het:</p><p>Recht op informatie over de verwerkingen: wat gebeurt er met je persoonsgegevens en waarom?</p><p>Recht op inzage: je heeft het recht het Nationaal Energie Dashboard te verzoeken om te laten zien of het Nationaal Energie Dashboard jouw persoonsgegevens verwerkt, en zo ja, welke dan.</p><p>Recht op rectificatie: het Nationaal Energie Dashboard moet zorgen dat de gebruikte persoonsgegevens accuraat zijn en blijven. Je mag het Nationaal Energie Dashboard verzoeken om gegevens te corrigeren of aan te vullen.</p><p>Recht op vergetelheid: je hebt het recht het Nationaal Energie Dashboard te verzoeken om verwijdering van jouw persoonsgegevens. Het is dan aan het Nationaal Energie Dashboard om te bepalen of dat verzoek gerechtvaardigd is. Dit kan het geval zijn als de persoonsgegevens niet langer nodig zijn voor de doeleinden waarvoor deze zijn verwerkt of de persoonsgegevens onrechtmatig zijn verwerkt.</p><p>Recht op beperking van de verwerking: je hebt het recht het Nationaal Energie Dashboard te verzoeken de verwerking te beperken, bijvoorbeeld als de gegevens onjuist zijn of de verwerking onrechtmatig is.</p><p>Recht van bezwaar: je hebt het recht om met jouw specifieke situatie verband houdende redenen bezwaar te maken tegen verwerking van je persoonsgegevens. Het Nationaal Energie Dashboard staakt de verwerking tenzij er dwingende gerechtvaardigde gronden bestaan voor de verwerking die zwaarder wegen dan jouw belangen, rechten en vrijheden.</p><p><strong>Toestemming</strong></p><p>Je hebt toestemming gegeven om jouw persoonsgegevens te gebruiken. Je hebt te allen tijde het recht om deze toestemming in te trekken.</p><p><strong>Wijzigingen aan onze privacy statement</strong></p><p>Het Nationaal Energie Dashboard kan deze privacy statement indien nodig aanpassen. Het is daarom aan te raden geregeld op de website van het Nationaal Energie Dashboard te kijken voor de meest recente versie. Als het Nationaal Energie Dashboard de privacy statement bijwerkt, zal het Nationaal Energie Dashboard de datum achter \'Laatst bijgewerkt\' onderaan de privacy statement aanpassen. </p><p><strong>Klacht?</strong></p><p>Het Nationaal Energie Dashboard probeert altijd om met jou samen te werken om een eerlijke oplossing te vinden als je een klacht hebt over of een probleem heeft met het gebruik van jouw persoonsgegevens. Je kunt een klacht indienen via <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>.</p><p>Kom je er samen met ons niet uit, dan kun je je klacht indienen bij de <a href=\\\"https://autoriteitpersoonsgegevens.nl/nl/zelf-doen/gebruik-uw-privacyrechten/klacht-melden-bij-de-ap\\\">Autoriteit Persoonsgegevens</a>. De Autoriteit Persoonsgegevens houdt toezicht op het gebruik van persoonsgegevens.</p><p><strong>Contact</strong></p><p>Voor vragen over het gebruik van persoonsgegevens kun je een e-mail sturen aan <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>. </p><p><i>Laatst bijgewerkte versie 25 maart 2024</i></p>\"}',1,'2025-07-01 08:21:08','2025-07-01 08:21:08','47efb7f6-2df8-4559-b8c3-6783044dac37'),(1514,754,4,'Privacy statement','privacy-statement','en/privacy-statement',NULL,1,'2025-07-01 08:21:08','2025-07-01 08:21:08','6aeefbea-2143-47e8-ba81-2cfa281f5da3'),(1517,756,3,'Disclaimer','disclaimer','nl/disclaimer','{\"07b97bb6-b61e-402a-91e7-73cc34c76934\": \"<p>Het Nationaal Energie Dashboard publiceert op deze website ter informatie teksten, data, afbeeldingen en andere materialen. Het Nationaal Energie Dashboard behoudt zich daarbij het recht voor op elk moment de inhoud aan te passen of onderdelen te verwijderen zonder daarover (voorafgaande) mededeling te hoeven doen. In het bijzonder geeft Het Nationaal Energie Dashboard geen verklaring of garantie, expliciet of impliciet, met betrekking tot de nauwkeurigheid, betrouwbaarheid of volledigheid van de inhoud op deze website. </p><p><strong>Aansprakelijkheid</strong><br />Het Nationaal Energie Dashboard spant zich in om de inhoud op de website actueel en correct te houden. Ondanks deze zorg en aandacht is het mogelijk dat inhoud onvolledig, tijdelijk niet beschikbaar en/of onjuist is. Het Nationaal Energie Dashboard en de samenwerkende partijen zijn niet aansprakelijk voor enige schade (direct of indirect) voortvloeiend uit het gebruik van de website of de gegevens die beschikbaar zijn gesteld.</p><p>Voor op de website opgenomen hyperlinks naar websites of diensten van derden kan Het Nationaal Energie Dashboard nimmer aansprakelijkheid aanvaarden.</p><p>Deze disclaimer kan van tijd tot tijd wijzigen.</p><p><i>versie 1 maart 2024</i></p>\"}',1,'2025-07-01 08:21:56','2025-07-01 08:21:56','c6610fcf-f33f-40df-b586-1e540ef1604b'),(1518,756,4,'Disclaimer','disclaimer','en/disclaimer',NULL,1,'2025-07-01 08:21:56','2025-07-01 08:21:56','ca427b03-0e8c-4dbc-b234-4402984a6555'),(1521,758,3,'Algemene Voorwaarden Nationaal Energie Dashboard','algemene-voorwaarden','nl/algemene-voorwaarden','{\"07b97bb6-b61e-402a-91e7-73cc34c76934\": \"<p><i>Versie d.d. 01-01-2024</i><br /><br /><strong>Artikel 1 Definities</strong><br />1.1) “API”: de Application Programming Interface van Nationaal Energie Dashboard.<br /><br />1.2) “Gebruiker”: de gebruiker van het Product.<br /><br />1.3) “IE-rechten”:  alle (i) intellectuele eigendomsrechten, daaronder begrepen merken en andere herkomstaanduidingen, octrooien, auteursrechten, persoonlijkheidsrechten en databankrechten, ongeacht of deze geregistreerd zijn of vatbaar voor registratie, met inbegrip van aanvragen voor registratie daarvan, aanspraken op een en ander, of verwante rechten, zoals prioriteitsrechten en (voor)gebruiksrechten en rechten op bescherming of aanspraken van gelijke strekking waar ook ter wereld, en (ii) bedrijfsgeheimen en aanspraken op vertrouwelijkheid, daaronder begrepen rechten met betrekking tot uitvindingen, know-how en andere vertrouwelijke informatie en data.<br /><br />1.4) “Nationaal Energie Dashboard”: National Energy Information Services B.V. h.o.d.n. Nationaal Energie Dashboard, kantoorhoudend te Groningen, aan de Concourslaan 17, postcode 9727KC met KvK nummer: 91779324.<br /><br />1.5) “Product”: een benadering van de energiemix voor zowel (duurzame) productie als consumptie in Nederland, overeenkomstig de Overeenkomst. Het Product kan in de vorm bestaan van een beschikbaarheid van of een combinatie van vormen van een API en/of download.<br /><br />1.6) “Overeenkomst(en)”: elke overeenkomst tussen Partijen met betrekking tot het verrichten van Diensten als bedoeld in artikel 3 ten aanzien van alsmede het gebruik van het Product.<br /><br />1.7) “Partijen”: Nationaal Energie Dashboard en Gebruiker.<br /><br />1.8) “API key”: een unieke sleutel die de Gebruiker toegang geeft tot de API.<br /><br /><strong>Artikel 2 Toepasselijkheid</strong><br />2.1) Deze Algemene Voorwaarden beheersen de rechtsverhouding tussen Partijen en zijn steeds van toepassing op alle rechtshandelingen van Partijen met betrekking tot de totstandkoming en uitvoering van de Overeenkomst(en), alsmede op het gebruik van (inclusief toegang tot) het Product. Door gebruik van het Product, ook na beëindiging van de Overeenkomst, gaat de Gebruiker akkoord met deze Algemene Voorwaarden. Indien Gebruiker niet akkoord gaat met deze Algemene Voorwaarden, is het Gebruiker niet toegestaan het Product te gebruiken en/of enige inhoud te openen.<br /><br /><strong>Artikel 3 Diensten</strong><br />3.1) Nationaal Energie Dashboard verricht activiteiten op het gebied van het uitlezen, opslaan, interpoleren, aggregeren en benaderen van (verwachte) beschikbare (duurzame) energiegegevens, en wil deze gegevens of een uitwerking daarvan aanbieden aan de markt ten behoeve van kennisvoorziening. Nationaal Energie Dashboard biedt voornoemde aan in de vorm van data via een API en/of een download.<br /><br />3.2) Nationaal Energie Dashboard zal het Product gedurende de looptijd van de Overeenkomst beschikbaar stellen aan Gebruiker voor het beoogde gebruik, mits Gebruiker aan deze Algemene Voorwaarden voldoet.<br /><br />3.3) Nationaal Energie Dashboard zal het Product naar redelijkheid up-to-date houden. Gebruiker vrijwaart Nationaal Energie Dashboard van claims betreffende directe of indirecte kosten die ontstaan aan de zijde van Gebruiker door aanpassingen die Nationaal Energie Dashboard uitvoert op zijn Product. <br /><br />3.4) Bij beëindiging van de Overeenkomst dient Gebruiker het Product te verwijderen. Dit geldt niet voor de data die via de download is verkregen.<br /><br />3.5) De verstrekte API key is alleen voor de Gebruiker en mag niet openbaar gedeeld worden. Het is toegestaan om de API key te delen met een IT dienstenleverancier ten behoeve van het in de Overeenkomst beschreven doel. Gebruiker staat er voor in (en is daarvoor verantwoordelijk) dat een dergelijke IT dienstenleverancier de API key niet anders gebruikt dan voor het in de Overeenkomst omschreven doel. <br /><br />3.6) Het kopiëren, distribueren of anderzijds verkopen aan derden van het door Nationaal Energie Dashboard aan Gebruiker verstrekte Product is niet toegestaan zonder voorafgaande toestemming van Nationaal Energie Dashboard. Deze toestemming kan alleen in nadere overeenstemming met het Nationaal Energie Dashboard in een aparte overeenkomst verleend worden. <br /><br />3.7) Het gebruik van de API zal zoveel mogelijk beperkt worden tot de frequentie waarop de data door Nationaal Energie Dashboard beschikbaar wordt gesteld voor de Gebruiker, als nader omschreven in de Overeenkomst. Slechts enkel voor de inrichting van de software van de Gebruiker die de API aanroept mag deze vaker worden gebruikt. <br /><br />3.8) Bij vermoeden van verkeerd gebruik is Nationaal Energie Dashboard gerechtigd de toegang tot het Product te weigeren, zonder enige vorm van aansprakelijkheid te accepteren voor schade ontstaan bij Gebruiker ten gevolge van de geweigerde toegang. Nationaal Energie Dashboard kan daaropvolgend besluiten de Diensten aan Gebruiker en/of haar groepsmaatschappijen onverwijld te beëindigen. <br /><br /><strong>Artikel 4 Vergoeding </strong><br />4.1) Nationaal Energie Dashboard verleent Gebruiker kosteloos toegang tot het Product. <br /><br />4.2) Nationaal Energie Dashboard behoudt zich het recht voor om gedurende de looptijd van de Overeenkomst(en), de vergoeding voor het Product, met inachtneming van artikel 9, te wijzigen.<br /><br /><strong>Artikel 5 Communicatie </strong><br />5.1) De Gebruiker zal bij de totstandkoming van de Overeenkomst(en) één of meerdere geldige e-mailadressen opgeven aan Nationaal Energie Dashboard. De Gebruiker stemt ermee in dat Nationaal Energie Dashboard via de opgegeven e-mailadressen met de Gebruiker communiceert (over onder meer de uitvoering van de Overeenkomst(en)). Wijzigingen in de te gebruiken e-mailadressen dienen tijdig door de Gebruiker aan Nationaal Energie Dashboard te worden gemeld. <br /><br />5.2) De Gebruiker stemt bij het afgeven van één of meerdere geldige e-mailadressen ermee in dat Nationaal Energie Dashboard contact mag opnemen voor vragen met betrekking tot het gebruik van de data. <br /><br />5.3) De Gebruiker is zelf verantwoordelijk voor een correcte opgave van één of meerdere e-mailadressen. Tevens is de Gebruiker zelf verantwoordelijk voor bevoegd en adequaat gebruik van de opgegeven e-mailadressen. Nationaal Energie Dashboard is niet aansprakelijk voor schade die voortvloeit uit onjuist opgegeven e-mailadressen of inadequaat of onbevoegd gebruik van de opgegeven e-mailadressen.   <br /><br /><strong>Artikel 6 Duur en beëindiging </strong></p><p>6.1) Partijen hebben het recht om de Overeenkomst op te zeggen, de Gebruiker zonder opzegtermijn en Nationaal Energie Dashboard met inachtneming van een opzegtermijn van dertig kalenderdagen. <br /><br />6.2) Als de Gebruiker minstens zes maanden geen gebruik maakt van de API key, dan heeft Nationaal Energie Dashboard het recht om de toegang tot het Product en de Overeenkomst met onmiddellijke ingang te beëindigen. <br /><br />6.3) Als Nationaal Energie Dashboard van mening is dat zij op grond van de Gaswet, Elektriciteitswet 1998 of andere relevante regelgeving niet langer partij kan zijn bij de Overeenkomst en/of het Product beschikbaar kan stellen, dan heeft Nationaal Energie Dashboard het recht om de Overeenkomst en de toegang tot het Product met onmiddellijke ingang te beëindigen, zonder dat Nationaal Energie Dashboard enige vorm van kosten- of schadevergoeding verschuldigd zal zijn. <br /><br /><strong>Artikel 7 Aansprakelijkheid </strong><br />7.1) Ondanks dat de verstrekte data zorgvuldig worden samengesteld blijft het een inschatting waarvoor Nationaal Energie Dashboard geen enkele aansprakelijkheid kan aanvaarden ten aanzien van de volledigheid, juistheid en/of tijdigheid. <br /><br />7.2) Nationaal Energie Dashboard en onderaannemers zijn niet aansprakelijk voor enige schade (direct of indirect) voortvloeiend uit enig gebruik van de gegevens en/of het Product die beschikbaar zijn gesteld. <br /><br />7.3) De Gebruiker vrijwaart Nationaal Energie Dashboard en zijn toeleveranciers van eventuele claims (van derden) voor het gebruik van het Product.<br /><br /><strong>Artikel 8 Intellectuele eigendomsrechten </strong><br />8.1) Alle IE-Rechten van het Product berusten uitsluitend bij Nationaal Energie Dashboard of diens licentiegevers. De Gebruiker krijgt uitsluitend het recht het Product te gebruiken voor het doel overeenkomstig de Overeenkomst. Dit gebruiksrecht is niet-exclusief en niet overdraagbaar aan derden. Tevens mag de Gebruiker geen (sub)licentie(s) verstrekken. <br /><br />8.2) De Gebruiker is verplicht om bij gebruik van het Product bronvermelding te hanteren in de vorm van het logo van Nationaal Energie Dashboard en een link naar de website van Nationaal Energie Dashboard op te nemen. <br /><br />8.3) De eventueel aangeleverde capaciteit- en productiegegevens en de bewerkte gegevens blijven eigendom van de partij die ze heeft aangeleverd. Voornoemde gegevens zullen enkel geanonimiseerd aangeleverd worden en mogen geen persoonsgegevens bevatten. Nationaal Energie Dashboard behoudt zich het recht voor om deze gegevens in te zetten voor het duurzaam verbeteren van haar diensten. Tevens kunnen de geleverde gegevens in anonieme vorm onderdeel vormen van andere verstrekkingen door Nationaal Energie Dashboard en eventuele toeleveranciers zonder voorafgaand toestemming van de partij.<br /><br />8.4) De Gebruiker stemt er mee in dat Nationaal Energie Dashboard het logo van de Gebruiker (voor zover een bedrijf of instelling) op de website van Nationaal Energie Dashboard mag plaatsen. Indien vermelding van het logo niet (meer) gewenst is, zal de Gebruiker contact opnemen met Nationaal Energie Dashboard met een verzoek tot verwijdering van het logo. <br /><br /><strong>Artikel 9 Overig </strong><br />9.1) Nationaal Energie Dashboard is gerechtigd deze Algemene Voorwaarden te wijzigen indien en wanneer naar het redelijke oordeel van Nationaal Energie Dashboard een dergelijke wijziging noodzakelijk is. Nationaal Energie Dashboard zal de Gebruiker op redelijke wijze en ten minste een maand voor de wijzigingen van kracht worden op de hoogte brengen van de gewijzigde voorwaarden. <br /><br />9.2) Het ongeldig verklaren van een bepaling uit deze Algemene Voorwaarden zal geen effect hebben op de geldigheid van de andere in deze Algemene Voorwaarden opgenomen bepalingen. <br /><br />9.3) Overdracht van rechten/of verplichtingen uit de Overeenkomst door de Gebruiker aan derden is niet toegestaan zonder voorafgaande schriftelijke goedkeuring van Nationaal Energie Dashboard, welke toestemming niet op onredelijke gronden kan worden onthouden. <br /><br />9.4) Partijen zijn en blijven van elkaar onafhankelijke contractanten; de tot stand gekomen of te komen Overeenkomst is geenszins een partnership, een joint venture of enige andere vennootschapsrechtelijke samenwerking tussen Partijen. <br /><br /><strong>Artikel 10 Toepasselijk recht en forumkeuze </strong><br />10.1) Op de Overeenkomst en deze Algemene Voorwaarden is Nederlands recht van toepassing. <br /><br />10.2) Bij eventuele geschillen zullen Partijen dit eerst in onderling overleg trachten op te lossen. Wanneer dit niet lukt zal de rechtbank van Groningen uitsluitend bevoegd zijn over geschillen voortvloeiende uit of ter zake van de Overeenkomst en/of de Algemene Voorwaarden uitspraak te doen. <br /><br /><i>Algemene Voorwaarden NEIS BV 01-01-2024 </i><br /><br /><br /><br /><strong>Een Engelse vertaling van deze voorwaarden is op </strong><a href=\\\"https://ned.nl/nl/contact\\\"><strong>aanvraag</strong></a><strong> verkrijgbaar.</strong></p>\"}',1,'2025-07-01 08:22:36','2025-07-01 08:22:36','252d8285-2b35-4a9d-9d97-3e42d1bc4f39'),(1522,758,4,'Algemene voorwaarden','algemene-voorwaarden','en/terms-and-conditions',NULL,1,'2025-07-01 08:22:36','2025-07-01 08:22:36','ff24648b-00e5-4ece-9e47-d02ea057e1fd'),(1523,759,3,'Contact met ons','contact-met-ons',NULL,NULL,1,'2025-07-01 08:31:33','2025-07-01 08:31:48','60a16e0b-a4ea-4d7a-84fa-2dbaa7ef8abf'),(1524,759,4,'Contact met ons','contact-met-ons',NULL,NULL,1,'2025-07-01 08: