ing van elektriciteitsproductie op het seizoen. </p>\", \"59a4eb2d-3976-4008-af8e-49fd756f687e\": \"co2EmissionTotalLastMonths\"}',1,'2025-07-07 09:52:07','2025-07-07 09:57:43','0dd28e9d-6e63-42f5-8f90-732ce9b3a9bd'),(1600,797,4,'Co2 laatste 12 maanden','co2-laatste-12-maanden',NULL,'{\"169a00e9-924f-465d-894e-40456e04be9b\": \"<p>Tekst 2</p>\", \"318bed61-e89e-4de0-986a-2ac5f7c474cf\": \"<p>Tekst 1</p>\", \"59a4eb2d-3976-4008-af8e-49fd756f687e\": \"co2EmissionTotalLastMonths\"}',1,'2025-07-07 09:52:07','2025-07-07 09:52:07','63a2b76a-4e0a-456d-84be-e57923b5b459'),(1601,798,3,'Co2 monitor - Co2 emissiefactor','co2-monitor-co2-emissiefactor-vandaag','nl',NULL,1,'2025-07-07 09:52:08','2025-07-07 09:52:08','4725f239-19e5-4997-9893-5982ad6bc8e5'),(1602,798,4,'Co2 monitor - Co2 emissiefactor (vandaag)','co2-monitor-co2-emissiefactor-vandaag','en',NULL,1,'2025-07-07 09:52:08','2025-07-07 09:52:08','3d7b25da-df07-4a02-8935-18a0e0094749'),(1603,799,3,'CO2 Emissiefactor','co2-emissiefactor',NULL,'{\"4d3efb89-0e6f-4895-9545-fa3ee1bab78d\": \"<p>Een kleine intro op deze pagina. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque ac magna risus. Cras interdum facilisis nisi, in fermentum felis vestibulum vitae. Sed eu ante non sem tristique hendrerit quis vel dolor. Sed varius malesuada ipsum, varius condimentum nunc pretium eu. </p>\"}',1,'2025-07-07 09:52:08','2025-07-07 09:52:08','d9cb8e60-bef8-422e-90bc-2eedb71add49'),(1604,799,4,'CO2 Emissiefactor','co2-emissiefactor',NULL,NULL,1,'2025-07-07 09:52:08','2025-07-07 09:52:08','b43bafe2-4b9a-42ff-9c17-87b7dcd7a00c'),(1605,800,3,'12 maanden','12-maanden',NULL,NULL,1,'2025-07-07 09:52:08','2025-07-07 09:52:08','8632263c-d8e2-4cff-9786-ed2e6120c580'),(1606,800,4,'12 maanden','12-maanden',NULL,NULL,1,'2025-07-07 09:52:08','2025-07-07 09:52:08','6247db66-15df-4ec5-848a-b1274d3aaaf5'),(1607,801,3,'Co2 laatste 12 maanden','co2-laatste-12-maanden',NULL,'{\"169a00e9-924f-465d-894e-40456e04be9b\": \"<p>Tekst 2</p>\", \"318b