3 14:35:12','015c5c4c-3129-4c7e-b46f-0e9933f13708'),(1732,864,3,'Home','home',NULL,'{\"d28f538b-8ccc-433a-bcc1-e6e169ef239e\": {\"type\": \"entry\", \"value\": \"{entry:174@3:url}\"}}',1,'2025-07-23 14:35:39','2025-07-23 14:35:39','5c733987-cf57-4f0b-92ff-d2001ee338c6'),(1733,864,4,'Home','home',NULL,'{\"d28f538b-8ccc-433a-bcc1-e6e169ef239e\": {\"type\": \"entry\", \"value\": \"{entry:174@3:url}\"}}',1,'2025-07-23 14:35:39','2025-07-23 14:35:39','c9376710-6d26-40c8-b62a-c614dd3d2172'),(1734,865,3,'Privacy statement','privacy-statement','nl/privacy-statement','{\"07b97bb6-b61e-402a-91e7-73cc34c76934\": \"<p>Het Nationaal Energie Dashboard vindt het belangrijk dat er goed met jouw gegevens wordt omgegaan. In ons privacy statement leggen we uit waarom, waarvoor, hoe lang en welke gegevens we verzamelen. Ook leggen we uit wat jij eraan kan doen als jij het hier niet mee eens bent.</p><p><strong>Wat verzamelen we van jou en waarom?</strong></p><p>Welke gegevens wij van jou verzamelen hangt af van wat jij met Het Nationaal Energie Dashboard doet. Je bezoekt bijvoorbeeld onze website, bent geabonneerd op onze nieuwsbrief of je hebt een account. </p><p>Wat je ook komt doen: we verzamelen alleen gegevens die echt nodig zijn om het werk goed uit te kunnen voeren. We gaan dan ook altijd vertrouwelijk met jouw gegevens om en delen jouw gegevens niet met derden.</p><p>De verwerking van persoonsgegevens gebeurt op een wijze, die in overeenstemming is met de wet AVG (Algemene Verordening Gegevensbescherming). Hieronder sommen wij op wat wij van jou verzamelen.</p><p><i><strong>Heb je een account?</strong></i></p><p>Als je een account hebt bij Het Nationaal Energie Dashboard, dan kan je toegang krijgen tot de data. Wij verzamelen dan de volgende gegevens:</p><p>Jouw naam: zodat we weten wie gebruik maakt van de data en ook zodat we contact kunnen opnemen over onze dienstverlening, indien nodig. </p><p>E-mailadres: zodat we je kunnen mailen wanneer dat nodig is, bijvoorbeeld om de API key door te geven of updates in onze systemen aan te kondigen.</p><p>Gebruiksdoel: zodat we inzicht krijgen waarvoor je de energiedata wilt gebruiken. Dit kan ons helpen in verdere doorontwikkeling. </p><p>Bedrijfsnaam: zodat we weten welke bedrijven gebruik maken van onze energiedata. Het doorgeven van de bedrijfsnaam is optioneel. </p><p>Bij het aanmaken van het account ga je akkoord met onze <a href=\\\"https://ned.nl/nl/algemene-voorwaarden\\\">algemene voorwaarden</a>. </p><p><i><strong>Bezoek je onze website?</strong></i></p><p>Op onze website hebben we cookies. Wij gebruiken verschillende cookies die ervoor zorgen dat jouw bezoek aan onze website prettiger en makkelijker wordt en wij onze service nog beter op jouw wensen kunnen aanpassen.</p><p>Goed om te weten: wij verzamelen via cookies nooit persoonlijke informatie, zoals je naam, jouw telefoonnummer of e-mailadres. De data wordt niet aan derden verstrekt en voor analyse gebruiken wij alleen geanonimiseerde gegevens.</p><p>Voor het plaatsen van bepaalde cookies hebben wij jouw toestemming nodig. We vragen je toestemming wanneer je onze website bezoekt. Door op accepteren te klikken geef je via een actieve handeling (een opt-in) toestemming voor het plaatsen van cookies. Deze cookies passen we toe:</p><p><i>Functionele cookies</i><br />Verhogen het gebruikersgemak. Hierbij kan je denken aan bijvoorbeeld het onthouden van informatie die je invult en het herkennen van jouw browserinstellingen om onze website optimaal op je beeldscherm te kunnen weergeven.</p><p><i>Analytische cookies</i><br />Houden geanonimiseerd webstatistieken bij. We zien bijvoorbeeld dat een webpagina driehonderd keer is bekeken, maar niet door wie. Met deze informatie kunnen we onze website nog beter inrichten. </p><p><i>Tracking cookies</i><br />Volgen jouw online gedrag, zodat we weten wat je interessant vindt. Met deze informatie kunnen we je zo relevant mogelijke content aanbieden én kunnen we voorkomen dat je te vaak dezelfde content ziet.</p><p><i>Socialmedia-cookies</i><br />Als je klikt op socialmedia-buttons op onze website, bijvoorbeeld om een nieuwsitem te delen op LinkedIn, kan het zijn dat deze media cookies plaatsen op jouw device of pc. Hier zijn de voorwaarden van het desbetreffende socialmedia-kanaal zelf van toepassing.</p><p><i>Wilt je dat we geen cookies verzamelen?</i><br />Dat kan. Wij vragen als je onze website bezoekt actief of we cookies mogen verzamelen. Je kunt dan ook aangeven dat je dit niet wilt. Alternatief is dat je het niet verzamelen van cookies ook kan doorgeven via de instellingen van jouw browser.  </p><p><i><strong>Ontvang je onze nieuwsbrief?</strong></i></p><p>Dan hebben we alleen je e-mailadres en naam nodig. Jouw e-mailadres wordt alleen met expliciete toestemming toegevoegd aan onze lijst van nieuwsbrief abonnees. Je kunt je online inschrijven. Vervolgens ontvang je een bevestigingsmail om jouw inschrijving te activeren, dit heet ook wel een dubbele opt-in. Alleen als je al een account hebt aangemaakt, ontvang je geen bevestigingsmail. Je wordt dan rechtstreeks ingeschreven. En uiteraard bevat iedere nieuwsbrief ook een link waarmee je je weer kunt afmelden. Via de nieuwsbrief kun je ook zelf jouw gegevens beheren. Heb je hier toch vragen over, dan kun je altijd contact met ons opnemen met <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl.</a></p><p><i><strong>Ontvang je onze servicemails?</strong></i></p><p>Servicemails kunnen wij sturen naar accounthouders op het Nationaal Energie Dashboard. We maken onderscheid tussen servicemails die noodzakelijk zijn voor onze dienstverlening en nieuwsbrieven. </p><p>Servicemails die noodzakelijk zijn voor onze dienstverlening zijn bijvoorbeeld mailings met aankondiging van een update van de capaciteiten of onderhoudswerkzaamheden. Voor dit soort e-mails kun je je niet afmelden, omdat ze onderdeel zijn van onze dienstverlening.</p><p>Voor nieuwsbrieven geef je wel toestemming. Dit zijn bijvoorbeeld e-mails waarmee we je attenderen op nieuwe features of mogelijke uitbreidingen. Mocht je deze niet meer willen ontvangen, dan kun je dat aangeven via de link van de nieuwsbrief.</p><p><i><strong>Volg je ons?</strong></i></p><p>Dat vinden we leuk! Als je ons volgt op social media (X en LinkedIn) dan gelden de privacy-overeenkomsten van deze media zelf. Je kunt daar inloggen om jouw instellingen aan te passen.</p><p><strong>Bewaartermijn</strong></p><p>Het Nationaal Energie Dashboard verwijdert jouw persoonsgegevens zodra de wettelijke bewaartermijn is verlopen. Indien er geen wettelijke bewaartermijn is gedefinieerd, verwijderen wij jouw persoonsgegevens zodra de persoonsgegevens niet langer relevant zijn. Je kunt met vragen over een specifieke bewaartermijn voor bepaalde soorten persoonsgegevens een e-mail sturen aan <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>.</p><p><strong>Beveiliging</strong></p><p>Het Nationaal Energie Dashboard gebruikt passende technische, veiligheids- en organisatorische maatregelen om persoonsgegevens te beschermen en te helpen voorkomen dat diefstal, misbruik en onbevoegde toegang, verstrekking, wijziging en vernietiging van informatie kunnen plaatsvinden. Het Nationaal Energie Dashboard bewaart de persoonsgegevens bijvoorbeeld op computersystemen met beperkte toegang en in gecontroleerde omgevingen. Persoonsgegevens worden op een beveiligde manier opgeslagen op gecontracteerde servers in de EU.</p><p><strong>Wil je je gegevens inzien?</strong></p><p>Wil je je gegevens inzien, dan kun je contact met ons opnemen via <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>. Wij zullen zo snel mogelijk contact met je opnemen. We verstrekken informatie binnen een maand na ontvangst van jouw verzoek. Mocht je een complex verzoek hebben of juist een veelvoud aan verzoeken, dan kunnen wij deze termijn verlengen met twee maanden. Als dit het geval is, laten we jou dit weten.</p><p><strong>Welke gegevens kun je inzien?</strong></p><p>Je hebt het:</p><p>Recht op informatie over de verwerkingen: wat gebeurt er met je persoonsgegevens en waarom?</p><p>Recht op inzage: je heeft het recht het Nationaal Energie Dashboard te verzoeken om te laten zien of het Nationaal Energie Dashboard jouw persoonsgegevens verwerkt, en zo ja, welke dan.</p><p>Recht op rectificatie: het Nationaal Energie Dashboard moet zorgen dat de gebruikte persoonsgegevens accuraat zijn en blijven. Je mag het Nationaal Energie Dashboard verzoeken om gegevens te corrigeren of aan te vullen.</p><p>Recht op vergetelheid: je hebt het recht het Nationaal Energie Dashboard te verzoeken om verwijdering van jouw persoonsgegevens. Het is dan aan het Nationaal Energie Dashboard om te bepalen of dat verzoek gerechtvaardigd is. Dit kan het geval zijn als de persoonsgegevens niet langer nodig zijn voor de doeleinden waarvoor deze zijn verwerkt of de persoonsgegevens onrechtmatig zijn verwerkt.</p><p>Recht op beperking van de verwerking: je hebt het recht het Nationaal Energie Dashboard te verzoeken de verwerking te beperken, bijvoorbeeld als de gegevens onjuist zijn of de verwerking onrechtmatig is.</p><p>Recht van bezwaar: je hebt het recht om met jouw specifieke situatie verband houdende redenen bezwaar te maken tegen verwerking van je persoonsgegevens. Het Nationaal Energie Dashboard staakt de verwerking tenzij er dwingende gerechtvaardigde gronden bestaan voor de verwerking die zwaarder wegen dan jouw belangen, rechten en vrijheden.</p><p><strong>Toestemming</strong></p><p>Je hebt toestemming gegeven om jouw persoonsgegevens te gebruiken. Je hebt te allen tijde het recht om deze toestemming in te trekken.</p><p><strong>Wijzigingen aan onze privacy statement</strong></p><p>Het Nationaal Energie Dashboard kan deze privacy statement indien nodig aanpassen. Het is daarom aan te raden geregeld op de website van het Nationaal Energie Dashboard te kijken voor de meest recente versie. Als het Nationaal Energie Dashboard de privacy statement bijwerkt, zal het Nationaal Energie Dashboard de datum achter \'Laatst bijgewerkt\' onderaan de privacy statement aanpassen. </p><p><strong>Klacht?</strong></p><p>Het Nationaal Energie Dashboard probeert altijd om met jou samen te werken om een eerlijke oplossing te vinden als je een klacht hebt over of een probleem heeft met het gebruik van jouw persoonsgegevens. Je kunt een klacht indienen via <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>.</p><p>Kom je er samen met ons niet uit, dan kun je je klacht indienen bij de <a href=\\\"https://autoriteitpersoonsgegevens.nl/nl/zelf-doen/gebruik-uw-privacyrechten/klacht-melden-bij-de-ap\\\">Autoriteit Persoonsgegevens</a>. De Autoriteit Persoonsgegevens houdt toezicht op het gebruik van persoonsgegevens.</p><p><strong>Contact</strong></p><p>Voor vragen over het gebruik van persoonsgegevens kun je een e-mail sturen aan <a href=\\\"mailto:contact@ned.nl\\\">contact@ned.nl</a>. </p><p><i>Laatst bijgewerkte versie 25 maart 2024</i></p>\"}',1,'2025-07-23 14:35:39','2025-07-23 14:35:39','e3b01f95-6eef-42b2-a7d0-83bffdda913d'),(1735,865,4,'Privacy statement','privacy-statement','en/privacy-statement',NULL,1,'2025-07-23 14:35:39','2025-07-23 14:35:39','0a74c534-4385-4e66-8f19-a7c840e1d43a'),(1736,866,3,'Home','home',NULL,'{\"d28f538b-8ccc-433a-bcc1-e6e169ef239e\": {\"type\": \"entry\", \"value\": \"{entry:174@3:url}\"}}',1,'2025-07-23 14:35:39','2025-07-23 14:35:39','a56510d5-06e4-4d2d-af6a-ad8f769ba0a0'),(1737,866,4,'Home','home',NULL,'{\"d28f538b-8ccc-433a-bcc1-e6e169ef239e\": {\"type\": \"entry\", \"value\": \"{entry:174@3:url}\"}}',1,'2025-07-23 14:35:39','2025-07-23 14:35:39','4d58e5d5-38fe-479f-88a8-13130b3a7d20'),(1738,867,3,'Co2 emissiefactor','co2-monitor-co2-emissiefactor-vandaag','nl',NULL,1,'2025-07-23 14:36:22','2025-07-23 14:36:22','11f27d33-764e-4493-978a-b88e3678ddb9'),(1739,867,4,'Co2 monitor - Co2 emissiefactor (vandaag)','co2-monitor-co2-emissiefactor-vandaag','en',NULL,1,'2025-07-23 14:36:22','2025-07-23 14:36:22','093b8271