igendomsrechten, daaronder begrepen merken en andere herkomstaanduidingen, octrooien, auteursrechten, persoonlijkheidsrechten en databankrechten, ongeacht of deze geregistreerd zijn of vatbaar voor registratie, met inbegrip van aanvragen voor registratie daarvan, aanspraken op een en ander, of verwante rechten, zoals prioriteitsrechten en (voor)gebruiksrechten en rechten op bescherming of aanspraken van gelijke strekking waar ook ter wereld, en (ii) bedrijfsgeheimen en aanspraken op vertrouwelijkheid, daaronder begrepen rechten met betrekking tot uitvindingen, know-how en andere vertrouwelijke informatie en data.<br /><br />1.4) “Nationaal Energie Dashboard”: National Energy Information Services B.V. h.o.d.n. Nationaal Energie Dashboard, kantoorhoudend te Groningen, aan de Concourslaan 17, postcode 9727KC met KvK nummer: 91779324.<br /><br />1.5) “Product”: een benadering van de energiemix voor zowel (duurzame) productie als consumptie in Nederland, overeenkomstig de Overeenkomst. Het Product kan in de vorm bestaan van een beschikbaarheid van of een combinatie van vormen van een API en/of download.<br /><br />1.6) “Overeenkomst(en)”: elke overeenkomst tussen Partijen met betrekking tot het verrichten van Diensten als bedoeld in artikel 3 ten aanzien van alsmede het gebruik van het Product.<br /><br />1.7) “Partijen”: Nationaal Energie Dashboard en Gebruiker.<br /><br />1.8) “API key”: een unieke sleutel die de Gebruiker toegang geeft tot de API.<br /><br /><strong>Artikel 2 Toepasselijkheid</strong><br />2.1) Deze Algemene Voorwaarden beheersen de rechtsverhouding tussen Partijen en zijn steeds van toepassing op alle rechtshandelingen van Partijen met betrekking tot de totstandkoming en uitvoering van de Overeenkomst(en), alsmede op het gebruik van (inclusief toegang tot) het Product. Door gebruik van het Product, ook na beëindiging van de Overeenkomst, gaat de Gebruiker akkoord met deze Algemene Voorwaarden. Indien Gebruiker niet akkoord gaat met deze Algemene Voorwaarden, is het Gebruiker niet toegestaan het Product te gebruiken en/of enige inhoud te openen.<br /><br /><strong>Artikel 3 Diensten</strong><br />3.1) Nationaal Energie Dashboard verricht activiteiten op het gebied van het uitlezen, opslaan, interpoleren, aggregeren en benaderen van (verwachte) beschikbare (duurzame) energiegegevens, en wil deze gegevens of een uitwerking daarvan aanbieden aan de markt ten behoeve van kennisvoorziening. Nationaal Energie Dashboard biedt voornoemde aan in de vorm van data via een API en/of een download.<br /><br />3.2) Nationaal Energie Dashboard zal het Product gedurende de looptijd van de Overeenkomst beschikbaar stellen aan Gebruiker voor het beoogde gebruik, mits Gebruiker aan deze Algemene Voorwaarden voldoet.<br /><br />3.3) Nationaal Energie Dashboard zal het Product naar redelijkheid up-to-date houden. Gebruiker vrijwaart Nationaal Energie Dashboard van claims betreffende directe of indirecte kosten die ontstaan aan de zijde van Gebruiker door aanpassingen die Nationaal Energie Dashboard uitvoert op zijn Product. <br /><br />3.4) Bij beëindiging van de Overeenkomst dient Gebruiker het Product te verwijderen. Dit geldt niet voor de data die via de download is verkregen.<br /><br />3.5) De verstrekte API key is alleen voor de Gebruiker en mag niet openbaar gedeeld worden. Het is toegestaan om de API key te delen met een IT dienstenleverancier ten behoeve van het in de Overeenkomst beschreven doel. Gebruiker staat er voor in (en is daarvoor verantwoordelijk) dat een dergelijke IT dienstenleverancier de API key niet anders gebruikt dan voor het in de Overeenkomst omschreven doel. <br /><br />3.6) Het kopiëren, distribueren of anderzijds verkopen aan derden van het door Nationaal Energie Dashboard aan Gebruiker verstrekte Product is niet toegestaan zonder voorafgaande toestemming van Nationaal Energie Dashboard. Deze toestemming kan alleen in nadere overeenstemming met het Nationaal Energie Dashboard in een aparte overeenkomst verleend worden. <br /><br />3.7) Het gebruik van de API zal zoveel mogelijk beperkt worden tot de frequentie waarop de data door Nationaal Energie Dashboard beschikbaar wordt gesteld voor de Gebruiker, als nader omschreven in de Overeenkomst. Slechts enkel voor de inrichting van de software van de Gebruiker die de API aanroept mag deze vaker worden gebruikt. <br /><br />3.8) Bij vermoeden van verkeerd gebruik is Nationaal Energie Dashboard gerechtigd de toegang tot het Product te weigeren, zonder enige vorm van aansprakelijkheid te accepteren voor schade ontstaan bij Gebruiker ten gevolge van de geweigerde toegang. Nationaal Energie Dashboard kan daaropvolgend besluiten de Diensten aan Gebruiker en/of haar groepsmaatschappijen onverwijld te beëindigen. <br /><br /><strong>Artikel 4 Vergoeding </strong><br />4.1) Nationaal Energie Dashboard verleent Gebruiker kosteloos toegang tot het Product. <br /><br />4.2) Nationaal Energie Dashboard behoudt zich het recht voor om gedurende de looptijd van de Overeenkomst(en), de vergoeding voor het Product, met inachtneming van artikel 9, te wijzigen.<br /><br /><strong>Artikel 5 Communicatie </strong><br />5.1) De Gebruiker zal bij de totstandkoming van de Overeenkomst(en) één of meerdere geldige e-mailadressen opgeven aan Nationaal Energie Dashboard. De Gebruiker stemt ermee in dat Nationaal Energie Dashboard via de opgegeven e-mailadressen met de Gebruiker communiceert (over onder meer de uitvoering van de Overeenkomst(en)). Wijzigingen in de te gebruiken e-mailadressen dienen tijdig door de Gebruiker aan Nationaal Energie Dashboard te worden gemeld. <br /><br />5.2) De Gebruiker stemt bij het afgeven van één of meerdere geldige e-mailadressen ermee in dat Nationaal Energie Dashboard contact mag opnemen voor vragen met betrekking tot het gebruik van de data. <br /><br />5.3) De Gebruiker is zelf verantwoordelijk voor een correcte opgave van één of meerdere e-mailadressen. Tevens is de Gebruiker zelf verantwoordelijk voor bevoegd en adequaat gebruik van de opgegeven e-mailadressen. Nationaal Energie Dashboard is niet aansprakelijk voor schade die voortvloeit uit onjuist opgegeven e-mailadressen of inadequaat of onbevoegd gebruik van de opgegeven e-mailadressen.   <br /><br /><strong>Artikel 6 Duur en beëindiging </strong></p><p>6.1) Partijen hebben het recht om de Overeenkomst op te zeggen, de Gebruiker zonder opzegtermijn en Nationaal Energie Dashboard met inachtneming van een opzegtermijn van dertig kalenderdagen. <br /><br />6.2) Als de Gebruiker minstens zes maanden geen gebruik maakt van de API key, dan heeft Nationaal Energie Dashboard het recht om de toegang tot het Product en de Overeenkomst met onmiddellijke ingang te beëindigen. <br /><br />6.3) Als Nationaal Energie Dashboard van mening is dat zij op grond van de Gaswet, Elektriciteitswet 1998 of andere relevante regelgeving niet langer partij kan zijn bij de Overeenkomst en/of het Product beschikbaar kan stellen, dan heeft Nationaal Energie Dashboard het recht om de Overeenkomst en de toegang tot het Product met onmiddellijke ingang te beëindigen, zonder dat Nationaal Energie Dashboard enige vorm van kosten- of schadevergoeding verschuldigd zal zijn. <br /><br /><strong>Artikel 7 Aansprakelijkheid </strong><br />7.1) Ondanks dat de verstrekte data zorgvuldig worden samengesteld blijft het een inschatting waarvoor Nationaal Energie Dashboard geen enkele aansprakelijkheid kan aanvaarden ten aanzien van de volledigheid, juistheid en/of tijdigheid. <br /><br />7.2) Nationaal Energie Dashboard en onderaannemers zijn niet aansprakelijk voor enige schade (direct of indirect) voortvloeiend uit enig gebruik van de gegevens en/of het Product die beschikbaar zijn gesteld. <br /><br />7.3) De Gebruiker vrijwaart Nationaal Energie Dashboard en zijn toeleveranciers van eventuele claims (van derden) voor het gebruik van het Product.<br /><br /><strong>Artikel 8 Intellectuele eigendomsrechten </strong><br />8.1) Alle IE-Rechten van het Product berusten uitsluitend bij Nationaal Energie Dashboard of diens licentiegevers. De Gebruiker krijgt uitsluitend het recht het Product te gebruiken voor het doel overeenkomstig de Overeenkomst. Dit gebruiksrecht is niet-exclusief en niet overdraagbaar aan derden. Tevens mag de Gebruiker geen (sub)licentie(s) verstrekken. <br /><br />8.2) De Gebruiker is verplicht om bij gebruik van het Product bronvermelding te hanteren in de vorm van het logo van Nationaal Energie Dashboard en een link naar de website van Nationaal Energie Dashboard op te nemen. <br /><br />8.3) De eventueel aangeleverde capaciteit- en productiegegevens en de bewerkte gegevens blijven eigendom van de partij die ze heeft aangeleverd. Voornoemde gegevens zullen enkel geanonimiseerd aangeleverd worden en mogen geen persoonsgegevens bevatten. Nationaal Energie Dashboard behoudt zich het recht voor om deze gegevens in te zetten voor het duurzaam verbeteren van haar diensten. Tevens kunnen de geleverde gegevens in anonieme vorm onderdeel vormen van andere verstrekkingen door Nationaal Energie Dashboard en eventuele toeleveranciers zonder voorafgaand toestemming van de partij.<br /><br />8.4) De Gebruiker stemt er mee in dat Nationaal Energie Dashboard het logo van de Gebruiker (voor zover een bedrijf of instelling) op de website van Nationaal Energie Dashboard mag plaatsen. Indien vermelding van het logo niet (meer) gewenst is, zal de Gebruiker contact opnemen met Nationaal Energie Dashboard met een verzoek tot verwijdering van het logo. <br /><br /><strong>Artikel 9 Overig </strong><br />9.1) Nationaal Energie Dashboard is gerechtigd deze Algemene Voorwaarden te wijzigen indien en wanneer naar het redelijke oordeel van Nationaal Energie Dashboard een dergelijke wijziging noodzakelijk is. Nationaal Energie Dashboard zal de Gebruiker op redelijke wijze en ten minste een maand voor de wijzigingen van kracht worden op de hoogte brengen van de gewijzigde voorwaarden. <br /><br />9.2) Het ongeldig verklaren van een bepaling uit deze Algemene Voorwaarden zal geen effect hebben op de geldigheid van de andere in deze Algemene Voorwaarden opgenomen bepalingen. <br /><br />9.3) Overdracht van rechten/of verplichtingen uit de Overeenkomst door de Gebruiker aan derden is niet toegestaan zonder voorafgaande schriftelijke goedkeuring van Nationaal Energie Dashboard, welke toestemming niet op onredelijke gronden kan worden onthouden. <br /><br />9.4) Partijen zijn en blijven van elkaar onafhankelijke contractanten; de tot stand gekomen of te komen Overeenkomst is geenszins een partnership, een joint venture of enige andere vennootschapsrechtelijke samenwerking tussen Partijen. <br /><br /><strong>Artikel 10 Toepasselijk recht en forumkeuze </strong><br />10.1) Op de Overeenkomst en deze Algemene Voorwaarden is Nederlands recht van toepassing. <br /><br />10.2) Bij eventuele geschillen zullen Partijen dit eerst in onderling overleg trachten op te lossen. Wanneer dit niet lukt zal de rechtbank van Groningen uitsluitend bevoegd zijn over geschillen voortvloeiende uit of ter zake van de Overeenkomst en/of de Algemene Voorwaarden uitspraak te doen. <br /><br /><i>Algemene Voorwaarden NEIS BV 01-01-2024 </i><br /><br /><br /><br /><strong>Een Engelse vertaling van deze voorwaarden is op </strong><a href=\\\"https://ned.nl/nl/contact\\\"><strong>aanvraag</strong></a><strong> verkrijgbaar.</strong></p>\"}',1,'2025-07-23 14:37:37','2025-07-23 14:37:37','44ed9592-c1f0-4457-8130-5f69c31c2039'),(1755,875,4,'Algemene voorwaarden','algemene-voorwaarden','en/terms-and-conditions',NULL,1,'2025-07-23 14:37:37','2025-07-23 14:37:37','5ca2cb12-d1ed-439d-9fdf-0654b25158c9'),(1756,876,3,'Home','home',NULL,'{\"d28f538b-8ccc-433a-bcc1-e6e169ef239e\": {\"type\": \"entry\", \"value\": \"{entry:174@3:url}\"}}',1,'2025-07-23 14:37:37','2025-07-23 14:37:37','e6c5a9b9-3eab-48f8-a428-29c81d2097bf'),(1757,876,4,'Home','home',NULL,'{\"d28f538b-8ccc-433a-bcc1-e6e169ef239e\": {\"type\": \"entry\", \"value\": \"{